;s:44:\"http://wptavern.com?p=51087&preview_id=51087\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"http://wptavern.com/wpweekly-episode-223-celebrating-8-years-of-ithemes-with-cory-miller\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2202:\"<p>In this episode of WordPress Weekly, <a href=\"http://marcuscouch.com/\">Marcus Couch</a> and I are joined by Cory Miller, Founder of <a href=\"https://ithemes.com/\">iThemes</a>. Miller tells us what it&#8217;s been like to run the company for eight years. We discuss what&#8217;s changed in the WordPress ecosystem since the company&#8217;s founding in 2008.</p>\n<p>Near the end of the interview, Miller tells us what&#8217;s next in the pipeline with Backup Buddy 7.0 and Stash Live. If you enjoy listening to WordPress history, this episode is for you.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"http://wptavern.com/early-bird-tickets-for-wooconf-2016-now-on-sale\">Early Bird Tickets for WooConf 2016 Now on Sale</a><br />\n<a href=\"http://wptavern.com/first-global-wordpress-contributor-drive-set-for-january-30-31-2016\">First Global WordPress Contributor Drive Set For January 30-31, 2016</a></p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href=\"https://wordpress.org/plugins/hide-your-theme-name/\">Hide Your Theme Name</a> prevents people from detecting which theme your site is using.</p>\n<p><a href=\"https://wordpress.org/plugins/invitations-for-slack/\">Invitations for Slack </a>allows visitors to your site or registered users to invite themselves to your Slack team.</p>\n<p><a href=\"https://wordpress.org/plugins/ninja-signature-contract-forms-add-on/\">Ninja Forms Signature Contract Add-On </a>produces a legally enforceable and court recognized contract from a Ninja Form submission.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, March 3rd 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"http://www.wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #223:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 29 Jan 2016 00:57:02 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"WPTavern: Thank a WordPress Plugin and Theme Author Day 2016\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=51082\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"http://wptavern.com/thank-a-wordpress-plugin-and-theme-author-day-2016\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2341:\"<p>Today is normally <a href=\"https://wordpress.org/news/2009/01/thank-a-plugin-developer-day/\">Thank a Plugin Author Day</a> which motivates users to thank plugin authors but <a href=\"http://wptavern.com/thank-a-plugin-author-day-2015\">based on discussions</a> from last year&#8217;s event, I&#8217;ve decided to add theme authors to the mix. The purpose of the day is simple, give thanks and express gratitude to WordPress plugin and theme developers.</p>\n<p>There are several ways to celebrate the event, such as visiting the plugin or theme author’s website. The link is usually available via the plugin or theme&#8217;s page on WordPress.org. If you&#8217;ve discovered a useful plugin, consider giving the author a monetary donation.</p>\n<p>Another way to thank plugin and theme authors is to rate and review their work. Ratings and reviews are <a title=\"http://wptavern.com/rate-and-review-a-wordpress-plugin-day-set-for-october-17th\" href=\"http://wptavern.com/rate-and-review-a-wordpress-plugin-day-set-for-october-17th\">an easy way to send feedback</a> directly to an author. Make sure to provide actionable feedback instead of one or two-word reviews. A side effect of rating and reviewing plugins and themes, is that it’s one of many ways to contribute back to WordPress.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/11/BillionThanksFeaturedImage.png\" rel=\"attachment wp-att-34331\"><img class=\"size-full wp-image-34331\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/11/BillionThanksFeaturedImage.png?resize=796%2C267\" alt=\"Billion Thanks Featured Image\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/opensourceway/7007768456/\">opensourceway</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-sa/2.0/\">cc</a>\n<p>The <a href=\"https://wordpress.org/themes/\">WordPress theme directory</a> has more than 2k themes while the <a href=\"https://wordpress.org/plugins/\">plugin directory</a> has nearly 47k plugins. That&#8217;s a lot of volunteer time, effort, and code donated to the community.</p>\n<p><strong>Thank you</strong> to anyone who has ever published a WordPress plugin or theme whether it’s on one of the official directories or on GitHub. Without them, users wouldn’t be able to customize WordPress to make it their own.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 28 Jan 2016 18:54:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"WPTavern: Mark Root-Wiley Publishes Free Guide for Nonprofits That Use WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=51074\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"http://wptavern.com/mark-root-wiley-publishes-free-guide-for-nonprofits-that-use-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3287:\"<p>One of <a href=\"https://wordpress.org/\">WordPress&#8217;</a> greatest strengths is that it&#8217;s free to download and use. This makes it an excellent choice for nonprofit organizations that have a small budget. Nonprofits that can&#8217;t afford a developer to maintain their sites may opt to run it on their own.</p>\n<p>Managing a WordPress site requires a basic understanding of how plugins, themes, and WordPress works. Thankfully, there&#8217;s a new guide available called <a href=\"http://nonprofitwp.org/\">NonprofitWP,</a> by <a href=\"https://mrwweb.com/\">Mark Root-Wiley</a>, that tailors specifically to nonprofits that choose to manage their own sites with WordPress.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/NonProfitWordPressGuide.png\" rel=\"attachment wp-att-51076\"><img class=\"size-full wp-image-51076\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/NonProfitWordPressGuide.png?resize=1025%2C646\" alt=\"Front Page to Nonprofit WordPress Guide\" /></a>Front Page to Nonprofit WordPress Guide\n<p>The guide covers the following topics:</p>\n<ul>\n<li>Things to know before you get started</li>\n<li>Domains and Hosting</li>\n<li>Installing WordPress</li>\n<li>Choosing a Theme</li>\n<li>Selecting Plugins</li>\n<li>Entering and Managing Content</li>\n<li>Keeping Your Site Healthy</li>\n</ul>\n<p>There&#8217;s also a <a href=\"http://nonprofitwp.org/resources/free-stuff-for-nonprofit-wordpress-websites/\">resources section</a> with links to products and services that have special offers for nonprofits. Some of the products and services have an affiliate code that kicks back a certain percentage of sales to Root-Wiley.</p>\n<p>Root-Wiley published the guide in an effort to help nonprofits make the right decisions, &#8220;A good WordPress website is easy to manage and maintain, but a bad one is time-consuming and expensive to maintain. Making smart decisions when you get started with a new WordPress site is <em>key</em> to avoiding headaches later,&#8221; he said.</p>\n<p>&#8220;I&#8217;ve had a lot of clients where our first project was cleaning up after a volunteer or staff member who tried to do the site on their own. Sometimes that&#8217;s a live site and other times it&#8217;s a refresh that&#8217;s hit a wall. One time, I was the ​<strong>seventh</strong>​ developer on a project, but I was the first paid one and the one to launch the site.</p>\n<p>&#8220;So many of the problems these projects run into are in the very early stages where they went all in with a bad theme, picked the wrong plugin, or quite commonly, didn&#8217;t think through or understand their organization&#8217;s needs and how those should translate to a website,&#8221; Root-Wiley told the Tavern.</p>\n<p>Instead of publishing the information in an e-book, he used WordPress, &#8220;I chose to publish it as a website because I think that&#8217;s the most user-friendly format and I don&#8217;t want anything to get in the way with people accessing the information,&#8221; Root-Wiley said.</p>\n<p>While he doesn&#8217;t plan to open source the site anytime soon, people can submit content suggestions and ideas through the site&#8217;s <a href=\"http://nonprofitwp.org/about/contact/\">contact form</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 27 Jan 2016 22:23:29 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"WPTavern: First WordPress Meetup in Karachi Draws 125 Attendees\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=51051\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://wptavern.com/first-wordpress-meetup-in-karachi-draws-125-attendees\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2907:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/karachi-wordpress-meetup.jpg\" rel=\"attachment wp-att-51057\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/karachi-wordpress-meetup.jpg?resize=1025%2C532\" alt=\"karachi-wordpress-meetup\" class=\"aligncenter size-full wp-image-51057\" /></a></p>\n<p>The WordPress community in Karachi, Pakistan held its first meetup last weekend led by <a href=\"https://twitter.com/sewabs\" target=\"_blank\">Waseem Abbas</a>. The gathering drew 125 attendees and organizers have been receiving <a href=\"https://www.facebook.com/s.wasim.abbas/posts/1064760890225282?pnref=story\" target=\"_blank\">positive reviews and feedback</a>.</p>\n<p>The meetup featured two sessions, one on &#8220;WordPress Security&#8221; by Ahsan Parwez and the second on &#8220;WordPress Possibilities&#8221; by Usman Khalid. I spoke with Abbas who said that organizers were surprised by the depth of WordPress knowledge among the attendees.</p>\n<p>&#8220;We were expecting a beginner level audience,&#8221; Abbas said. &#8220;But when they started asking questions of the speakers, we were amazed. It is clear now that we should have more advanced discussions in future meetups. For the smaller beginner audience, we will be focusing on short live sessions.&#8221;</p>\n<p>Karachi, with a population of 25 million people, is one of the largest cities in the world. Pakistan&#8217;s WordPress community is growing rapidly, as evidenced by the <a href=\"http://wptavern.com/wordpress-community-growing-in-pakistan-500-attend-lahore-meetup\" target=\"_blank\">local meetup in Lahore that recently passed 500 attendees</a>. Karachi is five times the size of Lahore and has the potential to be home to a much larger WordPress community.</p>\n<p>&#8220;Pakistan is ranked 3rd on <a href=\"https://www.freelancer.com/\" target=\"_blank\">freelancer.com</a> and most of the projects are based on WordPress,&#8221; Abbas said. &#8220;It shows how people are using WordPress to change their lives in Pakistan. Many of the big WordPress companies have employees working from Pakistan.&#8221;</p>\n<p>Feedback from both Lahore and Karachi organizers indicates that the WordPress community in Pakistan is extensive, but 2015 and 2016 are the first years that leaders have emerged to get everyone connected.</p>\n<p>&#8220;People are working on different WordPress projects and websites professionally but are not connected with each other,&#8221; Abbas said. &#8220;WordPress is used by hundreds of bloggers and developers, but they don&#8217;t have a platform to connect.</p>\n<p>&#8220;After this meetup we have seen many business collaborations and idea sharing in the community,&#8221; he said. &#8220;It is a positive gesture and real motivation for us to scale the meetups in future.&#8221; The next Karachi meetup is scheduled for February 27th.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 27 Jan 2016 00:19:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"WPTavern: Your Chance to Give Feedback on WordPress’ Accessibility Coding Standards\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=51041\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"http://wptavern.com/your-chance-to-give-feedback-on-wordpress-accessibility-coding-standards\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4377:\"<p>The <a href=\"https://make.wordpress.org/accessibility/\">WordPress Accessibility team</a> is seeking feedback on a draft that outlines <a href=\"https://make.wordpress.org/core/handbook/best-practices/coding-standards/accessibility-coding-standards/\">accessibility coding standards</a> for WordPress core. According to the draft, new features should meet the accessibility guidelines before merging into core.</p>\n<blockquote><p>All code released in WordPress must conform with the WCAG 2.0 guidelines at level AA. These basic guidelines are intended for easy reference during development, but do not cover all possible accessibility issues.</p></blockquote>\n<p>While the document focuses on core, it&#8217;s also a great reference for developers who want their themes and plugins more accessible.</p>\n<h2>Matt Mullenweg Addresses WordPress&#8217; Accessibility</h2>\n<p>For the second year in a row, <a href=\"http://mor10.com/\">Morten Rand-Hendriksen</a>, an advocate for improving WordPress&#8217; accessibility, brought up the topic during the Q&amp;A portion of the 2015 State of the Word.</p>\n<p></p>\n<p>Hendriksen notes that in 2014, the WordPress theme directory <a href=\"http://wptavern.com/wordpress-themes-suck-at-accessibility-its-time-to-fix-it\">contained 14 themes</a> with the accessibility-ready tag. In 2015, that number increased to 79.</p>\n<p>Hendriksen brings up the fact that when WordPress adopts modern technologies, so does most of the web citing responsive images as an example. He asks Mullenweg if WordPress can do the same for accessibility in which the audience responds with applause. Mullenweg responds with a simple yes.</p>\n<h2>Thinking of Accessibility as Just a Checkbox</h2>\n<p>Hendriksen then asks a follow-up question, &#8220;Can you tell everyone in this room and community that when they learn JavaScript, to also add on that little accessibility part, so that we&#8217;re building everything accessible and tell the world that the web should be accessible and that&#8217;s the WordPress way?&#8221;</p>\n<p>Mullenweg responds by agreeing the web should be accessible but says, &#8220;I&#8217;m worried about getting to a point where we think of accessibility like a checkbox. Even though there are great guidelines and things like that, I think that accessibility is a process and it&#8217;s going to be driven sometimes not by every single person, but by groups like the <a href=\"https://make.wordpress.org/accessibility/\">amazing accessibility team</a> and most importantly by the people who need the technology, communicating, and us observing that.</p>\n<p>&#8220;So, I do think that we have presentations on accessibility at every single WordCamp, we have the accessibility guidelines online but I think we&#8217;re a little behind on the theme reviews which is part of the reason the number hasn&#8217;t grown as much because the accessibility reviews are more difficult than a standard review, but I&#8217;m really excited about what this group has been able to do and the growing momentum it&#8217;s gained in the WordPress world.&#8221;</p>\n<p>&#8220;I don&#8217;t think that saying I want things to be accessible moves things forward as much as the continuing education that we&#8217;re doing through every single WordCamp, the guidelines, and the group,&#8221; Mullenweg said. He also highlights the need to think of accessibility in a global sense.</p>\n<p>&#8220;I think about the 6.99 billion people who haven&#8217;t used WordPress yet and many of those who can&#8217;t. I also think about accessibility in terms of languages and touch devices.</p>\n<p>&#8220;These are things that as we get there, what we do right can expand to a larger audience. I encourage everyone to keep that in mind, but learn JavaScript as well,&#8221; he said.</p>\n<p>Mullenweg&#8217;s responses reinforce the fact that accessibility remains a priority for the WordPress project. If you notice a typo or want to give feedback on the WordPress accessibility guidelines draft, please <a href=\"https://make.wordpress.org/core/2016/01/24/accessibility-coding-standards-now-in-draft-and-seeking-comments/\">leave a comment</a> on the post. Also, check out the <a href=\"https://make.wordpress.org/accessibility/\">Make WordPress Accessible</a> site for information on how you can help make WordPress more accessible.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 26 Jan 2016 22:56:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Matt: Marketing at Automattic\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=45814\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"https://ma.tt/2016/01/marketing-at-automattic/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:917:\"<p>One of the areas where <a href=\"https://automattic.com/\">Automattic</a> and its products like <a href=\"https://wordpress.com/\">WordPress.com</a> have the most room for growth is in the area of marketing. It&#8217;s also an area our competitors are spending heavily in, with Wix, Weebly, Squarespace, Web.com, and to a lesser extent EIG and Godaddy, spending over $350M this year in advertising. (Of course marketing is much more than just advertising, but their spend is still significant.) <a href=\"https://automattic.com/work-with-us/\">We&#8217;re hiring for a number of positions in this area</a> to build up our team, including a CMO, a performance marketing specialist, marketing-oriented designer, and a role focused on events. If you know of anyone who would be ideal for these roles, or if that person is you, please read about Automattic on that page and follow the guidelines for the role to apply.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 26 Jan 2016 20:29:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"WPTavern: Kernl to Offer Hosted Private Plugin and Theme Updates\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50694\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"http://wptavern.com/kernl-to-offer-hosted-private-plugin-and-theme-updates\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7127:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/kernl.png\" rel=\"attachment wp-att-51020\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/kernl.png?resize=1025%2C483\" alt=\"kernl\" class=\"aligncenter size-full wp-image-51020\" /></a></p>\n<p><a href=\"https://twitter.com/jackslingerland\" target=\"_blank\">Jack Slingerland</a> started hacking on WordPress in 2008, but recently his career has taken him a bit further afield from it than he would like. By day he is a Senior Software Engineer at <a href=\"http://www.ca.com/us/default.aspx\" target=\"_blank\">CA Technologies</a> in Raleigh, working in React/Redux, Node, ElasticSearch, Grails, and Groovy. But at night he is busy building <a href=\"https://kernl.us/\" target=\"_blank\">Kernl</a>, a service that provides private plugin and theme updates for WordPress.</p>\n<p>Once a plugin has been added to the service, the updates delivered from Kernl will look exactly like updates from WordPress.org.</p>\n<p>&#8220;Kernl’s core feature is providing private plugin and theme updates for WordPress developers. However, our differentiating features are what get me excited,&#8221; Slingerland said. &#8220;We have purchase code validation (so only authorized users can download updates) and continuous integration (CI) support.</p>\n<p>&#8220;The CI stuff is really neat, because it allows WP developers to push their code into GitHub or BitBucket and then have it automatically packaged and deployed to their customers. CI has been traditionally hard to do on WordPress because your ‘production’ environment is often something you don’t control,&#8221; he said. &#8220;Kernl solves that problem.&#8221;</p>\n<p>The idea for Kernl came to Slingerland after previous years trudging through client work.</p>\n<p>&#8220;One thing that constantly nagged at me was how hard it was to get any bug fixes or feature updates out to my clients,&#8221; he said. &#8220;I often didn’t manage their sites, so getting them updates involved lots of emailing and communication overhead.</p>\n<p>&#8220;I originally had the idea for Kernl back in 2011, but never executed on it until last year,&#8221; Slingerland said. &#8220;I was hoping that I could help other people solve the same problem I had.&#8221;</p>\n<p>Kernl launched in private alpha in May 2015 with ~65 alpha users. In November he opened it up for public beta and the service now has approximately 100 beta users. Testers are currently putting Kernl through its paces:</p>\n<ul>\n<li>Kernl hosts 73 plugins &#038; 43 themes (117 total)</li>\n<li>The service processed 4.07 million update checks since May</li>\n<li>Kernl processes around ~2 update status checks / second</li>\n<li>14,100 updates have been downloaded from Kernl</li>\n</ul>\n<h3>How does Kernl compare to WP Pusher?</h3>\n<p>I asked Slingerland about how Kernl measures up to <a href=\"https://wppusher.com/\" target=\"_blank\">WP Pusher</a>, which allows developers to deploy WordPress themes and plugins from GitHub and Bitbucket.</p>\n<p>&#8220;Kernl doesn’t require your end-user to install anything besides your plugin/theme,&#8221; Slinglerland said. &#8220;If I understand WP Pusher correctly, you first install WP Pusher, then tell WP Pusher to manage updates for a given plugin/theme via it’s version control repository. But this has to happen on every end user installation and might feel complicated to non-technical users.</p>\n<p>&#8220;Kernl works seamlessly with your plugin/theme, just like those that are installed from the WordPress.org repository.  This makes installing and updating feel familiar and blend in seamlessly,&#8221; he said.</p>\n<p>&#8220;We also have purchase code validation, which is going to be getting some love and an API after we go live.  Kernl also supports versioning your plugin/theme, so intermediary commits don’t get randomly sent out to your customers.&#8221;</p>\n<h3>The Importance of Continuous Integration</h3>\n<p>One of the reasons Slingerland built Kernl is because he wants to help more WordPress developers add continuous integration to their workflows. This particular aspect of the app (the &#8220;push to build&#8221; feature) posed the biggest technical challenge but was one of the most important problems for Kernl to solve.</p>\n<p>&#8220;There are a lot of edge-cases that I didn’t foresee, especially once I started integrating with both BitBucket and GitHub,&#8221; Slingerland said. &#8220;In these cases the beta testers were invaluable in helping ferret out bugs.</p>\n<p>&#8220;Having a solid continuous integration and deployment workflow really changes the way you think about development,&#8221; he said. &#8220;Instead of having &#8216;big bang&#8217; once a quarter feature releases, it becomes easier to iterate on your idea. Fail fast, validate your ideas/changes, and iterate again. It’s a big enabler of the Agile development methodology, and I feel that the WordPress plugin/theme community has kind of lacked that. It encourages good testing as well, which is almost required if you are deploying continuously.&#8221;</p>\n<p>Slingerland is aiming Kernl at developers who create WordPress plugins and themes that are not hosted on WordPress.org. A handful of his beta users have even been using the service to distribute updates for their own beta testers before they publish an official release to WordPress.org.</p>\n<p>Kernl will host any plugin or theme for free as long as it is both open source and freely available. Pricing for commercial plugins and themes will range from $5 &#8211; $25/month. The service is free to use during the beta period, which is planned to be wrapped up in mid-February.</p>\n<h3>Kernl Will Not Police Product Licensing</h3>\n<p>After further inquiry regarding Kernl&#8217;s position on the licensing of products it hosts, Slingerland states that he will not police his customers&#8217; licensing. This means that authors of non-GPL themes and plugins would be welcome to distribute their software via his platform. Since themes and plugins are derivative works of WordPress, they are required to be licensed under the GPL.</p>\n<p>Slingerland&#8217;s lack of willingness to police non-GPL software has the potential to make Kernl a hive for products that break WordPress&#8217; license. The service makes it easy to distribute non-GPL software that masquerades in the admin as regular compliant plugins/themes when it comes to updates.</p>\n<p>Distributing non-GPL software can be a deal breaker for WordPress developers who feel strongly about the GPL. The GPL protects users&#8217; freedom to use and modify the software for any purpose, and many developers have built their businesses and reputations on upholding that freedom.</p>\n<p>Software hosted by Kernl may or may not comply with GPL licensing, and the user may never know. This leaves the user vulnerable in a way that official updates from WordPress.org does not. Developers who don&#8217;t want to be parcel to supporting a platform that has the potential to distribute non-GPL software may want to look for an alternative.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 26 Jan 2016 18:44:24 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Matt: Minsky\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=45808\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://ma.tt/2016/01/minsky/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:455:\"<p>Very sad to <a href=\"http://www.nytimes.com/2016/01/26/business/marvin-minsky-pioneer-in-artificial-intelligence-dies-at-88.html\">hear that Marvin Minsky has passed</a>. Here are some <a href=\"http://blog.the-eg.com/2007/12/03/marvin-minsky/\">notes I took at a talk of his in 2007</a>. See also: <a href=\"https://blogs.harvard.edu/philg/2016/01/25/marvin-minsky-1927-2016-the-death-of-a-skeptic/\">Philip Greenspun&#8217;s remembrence of Minsky</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 26 Jan 2016 04:48:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:93:\"WPTavern: PayPal for WooCommerce: How Andrew Angell Is Building a Business with a Free Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50941\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:102:\"http://wptavern.com/paypal-for-woocommerce-how-andrew-angell-is-building-a-business-with-a-free-plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9465:\"<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/business-desk.jpg\" rel=\"attachment wp-att-51010\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/business-desk.jpg?resize=1025%2C504\" alt=\"photo credit: Luis Llerena\" class=\"size-full wp-image-51010\" /></a>photo credit: <a href=\"https://stocksnap.io/photo/S3JE5YAMND\">Luis Llerena</a>\n<p>WooCommerce, which currently powers roughly 30% of online stores, has a growing catalogue of <a href=\"https://www.woothemes.com/product-category/woocommerce-extensions/\" target=\"_blank\">355 extensions</a> ranging from free to $249. Most of the major payment gateways are offered at $79 per single site license. There are also <a href=\"https://wordpress.org/plugins/search.php?q=woocommerce\" target=\"_blank\">hundreds of additional extensions</a> hosted on WordPress.org, including several payment gateway plugins that, if listed on the WooCommerce site, would be in direct competition to its major money makers.</p>\n<p><a href=\"https://wordpress.org/plugins/paypal-for-woocommerce/\" target=\"_blank\">PayPal for WooCommerce</a> is one such competitor. It adds PayPal Express Checkout, Payments Pro, and PayPal Plus (for Germany) to WooCommerce in a single, completely free plugin. It also utilizes all of the features PayPal provides in its APIs for seamless integration with WooCommerce. The plugin is active on more than 10,000 sites and has a 4.8/5.0 star rating on WordPress.org.</p>\n<p><a href=\"https://www.angelleye.com/\" target=\"_blank\">Andrew Angell</a> developed PayPal for WooCommerce after finding inadequacies in the leading plugin options at the time. Prior to creating the plugin, Angell spent many years becoming a PayPal specialist, earning much of his income taking PayPal-related development projects. He is now a PayPal Partner, certified PayPal developer, <a href=\"https://www.angelleye.com/paypal-developer-certified-award-winner/\" target=\"_blank\">3-time PayPal Star Developer award winner</a>, and a PayPal Ambassador.</p>\n<p>&#8220;I first started learning how to work with web services around the time PayPal had just released their first set of public APIs,&#8221; Angell said. &#8220;Payment processing was very important to my general web development work, of course, so I took the time to learn how to tightly integrate the PayPal API, which really taught me how to work with pretty much any API at that point. During this time I spent a lot of time in PayPal developer forums.&#8221;</p>\n<p>As PayPal introduced a wide variety of different API products over the years, Angell was able to become familiar with them one at a time as they were released. He spent a good deal of time providing free support to people looking for help with PayPal development on StackOverflow, which led to a seemingly never-ending supply of PayPal-specific client work and eventually a partnership with PayPal that pays him a revenue share based on the volume of transactions processed through their platform.</p>\n<p>&#8220;For a long time I was just another web developer that was using the PayPal forums as a way to generate work and prestige for the &#8220;angelleye&#8221; name,&#8221; Angell said. &#8220;The vast majority of the work that was coming to me was WordPress / WooCommerce type work where people wanted help getting PayPal working the way they want. My primary business model was to sell websites and custom jobs, and the PayPal revenue share was a nice little bonus on that.</p>\n<p>&#8220;As a general developer/user myself, when I would get these jobs I was thinking, oh great, Woo provides premium extensions for Express Checkout, Payments Pro, etc,&#8221; Angell said. &#8220;I&#8217;ll just buy those and we&#8217;ll use those in these projects to keep the time/cost down for my client.</p>\n<p>&#8220;As I started doing this, though, I quickly saw that while the Woo community builds a great shopping cart, they left much to be desired in the specific area of PayPal payment integration. Their plugins were missing lots of little features PayPal provides that are useful, and the error catching wasn&#8217;t done well, so successful payments could actually be flagged as failures, and other little things like that were just wrong. I found myself spending so much time extending/customizing their plugins that I just decided I needed to build my own. That&#8217;s how PayPal for WooCommerce was born,&#8221; he said.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/paypal-for-woocommerce.png\" rel=\"attachment wp-att-50993\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/paypal-for-woocommerce.png?resize=1025%2C331\" alt=\"paypal-for-woocommerce\" class=\"aligncenter size-full wp-image-50993\" /></a></p>\n<p>Angell&#8217;s first official WordPress plugin was a success, thanks to the popularity of WooCommerce as well as PayPal&#8217;s <a href=\"https://www.datanyze.com/market-share/payments/\" target=\"_blank\">67% market share</a> among payment gateways.</p>\n<p>&#8220;Because many others were experiencing the same struggles I was with Woo&#8217;s extensions, it [PayPal for WooCommerce] quickly became popular on its own &#8211; enough that it completely changed my business model,&#8221; Angell said. &#8220;I am now entirely focused on building tools like this, giving them away for free, and generating as much volume as I can.&#8221;</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/paypal-plugins.png\" rel=\"attachment wp-att-50996\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/paypal-plugins.png?resize=245%2C300\" alt=\"paypal-plugins\" class=\"alignright size-medium wp-image-50996\" /></a>Angell and his team are starting to play with the premium extension models that WooCommerce and many others use, but he said that PayPal for WooCommerce will always be completely free.</p>\n<p>&#8220;Our PayPal IPN for WordPress and our Offers for WooCommerce, though, do have some premium extensions that we&#8217;ll be selling licenses for, and we&#8217;ll continue to build on that as well as maintaining our free stuff,&#8221; he said.</p>\n<h3>A Non-Traditional Way of Monetizing a Free WordPress Product</h3>\n<p>Traditionally, the WordPress freemium product business model creates revenue by selling commercial licenses and support. With payment gateways it&#8217;s a little different because revenue sharing offers a more lucrative business opportunity. In this scenario it&#8217;s best if the product is free, although it still requires updates, support, and a reputation for reliability.</p>\n<p>Angell would not share with us his exact cut from the PayPal partnership program but said it&#8217;s only a fraction of a percent.</p>\n<p>&#8220;I don&#8217;t have any way to see exactly what this one plugin generated for us, but I can tell you that the combination of all the tools we have processed a total of $207 million in 2015,&#8221; Angell said. &#8220;PayPal for WooCommerce is by far our most popular tool, but we do have about 10 other tools that are helping with those numbers as well.&#8221;</p>\n<p>Maintaining a payment gateway by staying current with changes to the PayPal API is a ton of work. Add to that the burden of support for 10,000+ active installations, and WooCommerce for PayPal could be a full-time job. The revenue share business model makes supporting this free plugin worthwhile.</p>\n<p>&#8220;The model is just nicer for me because I can simply support the product instead of having so many clients breathing down my neck with deadlines,&#8221; Angell said. &#8220;I simply make sure I respond quickly to people in the support forums and fix bugs in the plugins whenever necessary as quickly as possible.</p>\n<p>&#8220;Because of the quality development and our expertise in ensuring PayPal is integrated well, we really don&#8217;t have a lot of issues keeping up with support. Most of the bug reports we get involve conflicts with other plugins, so as long as I make sure our stuff continues to work with new updates of WordPress and WooCommerce we can generally get through our days stress free,&#8221; he said.</p>\n<p>&#8220;We have definitely thought about building similar extensions for other plugins like GravityForms, etc. but we&#8217;re still in growth stages here and aren&#8217;t working with a very big budget,&#8221; Angell said. &#8220;Only myself and one other developer are managing all of these tools right now, and that&#8217;s on top of all the client work we still have and do on a regular basis just because we didn&#8217;t want to kill relationships with good clients.&#8221;</p>\n<p>Angell and his team also benefit from keeping PayPal for WooCommerce open source and freely <a href=\"https://github.com/angelleye/paypal-woocommerce\" target=\"_blank\">available on GitHub</a>, where they can receive contributions and bug reports for improvements. Since the business model doesn&#8217;t revolve around selling licenses and limiting the number of sites that can use them, there&#8217;s no need to keep the code locked up.</p>\n<p>The model also works out well for the users, who receive a high quality plugin and support for free as opposed to paying <a href=\"https://www.woothemes.com/products/paypal-pro/\" target=\"_blank\">$79 for a single license of PayPal Pro</a> or $199 for up to 25 sites. PayPal for WooCommerce, on the other hand, can be used on an unlimited number of sites for free.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 25 Jan 2016 21:59:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"WPTavern: First Global WordPress Contributor Drive Set For January 30-31, 2016\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50974\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"http://wptavern.com/first-global-wordpress-contributor-drive-set-for-january-30-31-2016\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2385:\"<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/01/WCSFContributorDayFeaturedImage.jpg\" rel=\"attachment wp-att-14814\"><img class=\"aligncenter size-full wp-image-14814\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/01/WCSFContributorDayFeaturedImage.jpg?resize=650%2C200\" alt=\"WordCamp San Francisco Contributor Day Featured Image\" /></a>I know a lot of people in the community who got their start answering questions in the <a href=\"https://wordpress.org/support/\">WordPress support forums</a>. It&#8217;s one of the easiest ways to contribute back to the project without having to touch code. If you&#8217;re interested in helping others in the support forums, check out the <a href=\"https://wordpress.org/news/2016/01/contributor-weekend-support-forums/\">first global contributor drive</a> on January 30-31, 2016.</p>\n<p>Contributor drives are new initiatives created by the <a href=\"https://make.wordpress.org/community/\">WordPress Community Team</a>. While a number of WordCamps have a day set aside for attendees to contribute back to WordPress, not everyone has one nearby they can attend. The first drive is focused on the <a href=\"https://make.wordpress.org/support\">Support Team</a> which answers questions in the <a href=\"https://wordpress.org/support\">support forums</a>.</p>\n<p>The drives are composed of challenges that take place over the course of a weekend to give people in different time zones an opportunity to participate. On this drive, contributors are challenged to answer 20 support requests in the forums.</p>\n<p>While individuals can participate, it&#8217;s a lot more fun to do so as a group. Participants are encouraged to work with people from their local meetup group. If this isn&#8217;t feasible, join the <a href=\"https://wordpress.slack.com/messages/forums/\">#forums channel</a> on Slack where moderators will be standing by to provide guidance to new contributors.</p>\n<p>WordPress has an amazing world-wide community and if 30 people complete the challenge, 600 threads will be responded too. Initiatives like this are a great idea and an excellent opportunity for new contributors to get their feet wet.</p>\n<p>For more details and directions on how to participate, please view the <a href=\"https://make.wordpress.org/support/20-questions/\">guide to contributor weekend</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 25 Jan 2016 19:28:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:10;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"WPTavern: In Case You Missed It – Issue 1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50935\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"http://wptavern.com/in-case-you-missed-it-issue-1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6878:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/ICYMIFeaturedImage.png\" rel=\"attachment wp-att-50955\"><img class=\"size-full wp-image-50955\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/ICYMIFeaturedImage.png?resize=676%2C292\" alt=\"In Case You Missed It Featured Image\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/112901923@N07/16153818039\">Night Moves</a> &#8211; <a href=\"https://creativecommons.org/licenses/by-nc/2.0/\">(license)</a>\n<p>There&#8217;s a lot of great WordPress content published in the community but not all of it is featured on the Tavern. Starting today and every Friday, I&#8217;ll share an assortment of items related to WordPress that caught my eye but didn&#8217;t make it into a full post.</p>\n<h2>Beyond Imagination by Dustin Filippini</h2>\n<p>Dustin Filippini, <span class=\"st\">a web developer based in Milwaukee, WI</span> <a href=\"http://heropress.com/essays/beyond-imagination/\">shared his HeroPress story</a> on how he got involved with WordPress. When Filippini was fired after two years of working in a retail management position, he dedicated all of his resources to learning web design and development in the late 90s and early 2000s.</p>\n<p>While the firing was a blow to his self-esteem, it provided him with the motivation to follow his passion. Filippini turned a bad situation into one of the best things that&#8217;s ever happened to him. Filippini&#8217;s story is another example that shows why local WordPress meetups are the cornerstone of the community.</p>\n<h2>A/B Testing With WordPress</h2>\n<p>There&#8217;s a <a href=\"https://wpchat.com/t/ab-testing-plugin-or-service-what-do-you-use/1259\">great discussion on WPChat.com</a> where folks are sharing information on the services and plugins they use to A/B test sites. The thread includes input from Josh Pollock, who develops <a href=\"http://ingothq.com/\">Ingot</a>, an A/B testing plugin for WordPress.</p>\n<h2>Freedom, Speech, and Codes of Conduct</h2>\n<p>Morten Rand-Hendriksen <a href=\"http://mor10.com/on-freedom-and-speech/\">published a great article</a> that dives into the freedom of speech, hate speech, codes of conduct, and the idea of speech as an act. I don&#8217;t understand what so many people have against codes of conduct but I agree with Hendriksen when he says:</p>\n<blockquote><p>Codes of Conduct are in place to protect everyone’s rights: They ensure a space in which a civil discourse can take place without anyone resorting to personal attacks and creating an environment that becomes inaccessible or actively hostile to participants or groups. Codes of Conduct ensure open spaces for freedom of expression.</p></blockquote>\n<h2>The Story Behind the Wapuu Coins at WordCamp US 2015</h2>\n<p>For many attendees at WordCamp US, the metal challenge coins distributed by GoDaddy <a href=\"https://twitter.com/benjaminefox/status/676987883954245633\">were a hit</a>. Mendel Kurland, Evangelist for GoDaddy, <a href=\"https://mendel.me/community/event/conference/wordcamp/2015/the-story-behind-the-wordcamp-us-godaddy-coins/\">shares the story</a> and meaning behind the coins. Also, make sure you read the rules to<a href=\"http://www.goatlocker.org/resources/cpo/history/cpocoin.htm\"> a game </a>that&#8217;s played at WordCamps that involves the challenge coin.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/WordCampUSCoins.jpg\" rel=\"attachment wp-att-50946\"><img class=\"size-full wp-image-50946\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/WordCampUSCoins.jpg?resize=600%2C450\" alt=\"WordCamp US Challenge Coins\" /></a>WordCamp US Challenge Coins\n<p>For those who don&#8217;t know, <a href=\"http://marktimemedia.com/project/wapuu-challenge-coins-2/\">the coins</a> were designed by Michelle Schulp of <a href=\"http://marktimemedia.com/\">Marktime Media</a>.</p>\n<h2>Reminder About the WordPress Plugin Directory Tag Policy</h2>\n<p>If you&#8217;re planning to submit your plugin to the WordPress plugin directory, please review the guidelines regarding the use of tags. In general, plugins are limited to 12 or less and tags should relate to the plugin&#8217;s features.</p>\n<blockquote class=\"wp-embedded-content\"><p><a href=\"https://make.wordpress.org/plugins/2016/01/20/reminder-policy-about-tags-in-plugin-readmes/\">Reminder: Policy About Tags In Plugin Readmes</a></p></blockquote>\n<p></p>\n<h2>Endless Stream of WordPress Positivity</h2>\n<p>The WordPress project <a href=\"http://wptavern.com/wordpress-is-revamping-its-testimonials-page-with-ilovewp-social-media-campaign\">recently revamped</a> its <a href=\"https://wordpress.org/about/testimonials/\">testimonials page</a> that features testimonials from people sharing their love of WordPress on social media. Browsing the <a href=\"https://twitter.com/hashtag/ilovewp?src=hash\">#ilovewp hashtag</a> on Twitter shows that there&#8217;s a lot to like about WordPress.</p>\n<blockquote class=\"twitter-tweet\" width=\"550\"><p lang=\"en\" dir=\"ltr\"><a href=\"https://twitter.com/hashtag/ilovewp?src=hash\">#ilovewp</a> because of the community. I have found my tribe, full of people who collaborate and love building cool stuff.</p>\n<p>&mdash; Andy Stitt (@andywpdev) <a href=\"https://twitter.com/andywpdev/status/690592726761508864\">January 22, 2016</a></p></blockquote>\n<p></p>\n<h2>A Look Back at the History of WordPress User Interfaces</h2>\n<p>Although it was published in 2014, <a href=\"http://www.wpexplorer.com/history-wordpress-ui/\">this post by WPExplorer</a> that looks at the history of the WordPress user interface is great reference material. It&#8217;s difficult to install older versions of WordPress to obtain screenshots which is why the post is a treasure trove of information. The user interface has come a long way since its creation in 2003.</p>\n<h2>Hot Cocoa/Coffee Wapuu!</h2>\n<p>In what will be a traditional part of this series, I&#8217;m going to end each issue by featuring a Wapuu design. For those who don&#8217;t know, Wapuu is the <a href=\"http://wapuu.jp/2015/12/12/wapuu-origins/\">unofficial mascot</a> of the WordPress project. As it&#8217;s Winter here in the US, Hot Cocoa/Coffee Wapuu, designed by Michelle Schulp, is one most of us can relate too.</p>\n<blockquote class=\"twitter-tweet\" width=\"550\"><p lang=\"en\" dir=\"ltr\">Special <a href=\"https://twitter.com/hashtag/wapuu?src=hash\">#wapuu</a> for the season: Hot Cocoa/Coffee Wapuu! Some of you might see him around :) <a href=\"https://t.co/U6bPpmUyXm\">pic.twitter.com/U6bPpmUyXm</a></p>\n<p>&mdash; Michelle Schulp ☜ (@marktimemedia) <a href=\"https://twitter.com/marktimemedia/status/677256313844326400\">December 16, 2015</a></p></blockquote>\n<p></p>\n<p>That&#8217;s it for issue one. If you recently discovered a cool resource or post related to WordPress, please share it with us in the comments.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 22 Jan 2016 21:26:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:11;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"WPTavern: Deployer App Pushes Plugins from GitHub to WordPress.org\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50938\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"http://wptavern.com/deployer-app-pushes-plugins-from-github-to-wordpress-org\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4632:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/deployer.png\" rel=\"attachment wp-att-50944\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/deployer.png?resize=1025%2C493\" alt=\"deployer\" class=\"aligncenter size-full wp-image-50944\" /></a></p>\n<p><a href=\"http://arunas.co/\" target=\"_blank\">Arūnas Liuiza</a>, like many other WordPress developers, prefers to develop his plugins on GitHub, thanks to the collaborative tools for issue tracking, merging, and pull requests. Hosting and developing open source projects on GitHub is much easier than trying to get any participation from the community via a plugin&#8217;s Subversion repo on WordPress.org.</p>\n<p>For these reasons Liuiza decided to create <a href=\"http://deployer.edwinapp.com/\" target=\"_blank\">Deployer</a>, a service that allows plugin developers to publish plugins to the WordPress.org Plugin Directory directly from GitHub, without using Subversion at all. He first presented the app at <a href=\"http://lithuania.wordcamp.org/\" target=\"_blank\">WordCamp Lithuania</a> in September 2015, but hasn&#8217;t yet given it much promotion.</p>\n<p>&#8220;I wanted to streamline the process of publishing plugins from GitHub to WordPress.org,&#8221; Liuiza said. &#8220;I have more than 10 plugins in the repository, so I want to do things fast and easily.&#8221;</p>\n<p>Last July we covered a similar service called <a href=\"http://wptavern.com/ship-a-new-app-for-shipping-plugins-from-github-to-wordpress-org\" target=\"_blank\">Ship</a>, which offered a hassle free approach to shipping plugins directly from GitHub to WordPress.org. Liuiza, with 10 plugins to maintain, was initially excited about Ship but found there were several drawbacks.</p>\n<p>&#8220;First, Ship required pretty wide access to my GitHub account,&#8221; he said. &#8220;GitHub does not provide granular API access, so I’d have to grant Ship access to all my GitHub repos, not only the one I wanted to publish from. That includes my private repos.</p>\n<p>&#8220;Second, Ship needed my WordPress.org credentials. And because it will need to use them regularly, they could not really hash them and had to store them in plaintext. Again, that would give Ship access to everything in my WordPress.org account. All plugins, all themes, all comments, all translations, etc. Everything.&#8221;</p>\n<p>This inspired Liuiza to create Deployer with a new approach that doesn&#8217;t require giving away access and credentials.</p>\n<p>&#8220;In comparison to Ship, Deployer takes a quite opposite stance when it comes to requiring access,&#8221; he said. &#8220;Where Ship requests a lot of privileges, Deployer asks for almost none.</p>\n<p>&#8220;Deployer asks no privileges on GitHub. Public GitHub repositories can be cloned without any limitations by anyone, so Deployer does that. Deployer would need access to set up a WebHook for itself, but instead of requesting access Deployer provides step by step instructions for user how to set up the Webhook manually,&#8221; Liuiza said.</p>\n<p>The Deployer service doesn&#8217;t handle any sensitive authentication data for GitHub or WordPress.org. Instead, it requires a more manual setup.</p>\n<p>&#8220;Instead of requiring user’s WordPress.org credentials, Deployer has a dedicated WordPress.org user, deployer,&#8221; Liuiza said. &#8220;The plugin author has to manually add the deployer user to his plugin’s committer list, thus allowing that user to commit code to plugin’s SVN repository. This also enhances security, because WordPress.org can identify all the commits, made by the deployer user and roll them back in case there is a breach from Deployer’s side.&#8221;</p>\n<p>Pushing a new version of a plugin from GitHub to WordPress.org is as easy as tagging the new version on GitHub. Deployer even handles updates to the readme.txt file and the assets directory.</p>\n<p>&#8220;In terms of technology, Deployer is basically a single PHP file, that parses calls from GitHub Webhooks and then executes a bunch of shell commands (mostly git and svn) on a small Linux VPS box,&#8221; Liuiza said.</p>\n<p>Since launching last year, 34 plugins have been registered with Deployer, although Liuiza said he doesn&#8217;t keep logs on how many developers are using it regularly. He doesn&#8217;t currently have plans to monetize it but is happy to <a href=\"http://arunas.co/#coffee\" target=\"_blank\">accept donations</a>.</p>\n<p>&#8220;Unless it becomes a drain on my resources (and it does not seem likely at this point) it will always be a free tool,&#8221; Liuiza said.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 22 Jan 2016 20:59:44 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:12;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"WPTavern: WordPress is Revamping Its Testimonials Page with #ilovewp Social Media Campaign\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50890\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"http://wptavern.com/wordpress-is-revamping-its-testimonials-page-with-ilovewp-social-media-campaign\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6783:\"<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/heart.jpg\" rel=\"attachment wp-att-50928\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/heart.jpg?resize=800%2C378\" alt=\"photo credit: Wear your heart on a string - (license)\" class=\"size-full wp-image-50928\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/34039290@N06/4683226311\">Wear your heart on a string</a> &#8211; <a href=\"https://creativecommons.org/licenses/by-nc-nd/2.0/\">(license)</a>\n<p>WordPress.org is getting some love in 2016. In addition to a beautifully redesigned <a href=\"https://login.wordpress.org/\" target=\"_blank\">login page</a>, the <a href=\"https://wordpress.org/about/testimonials/\" target=\"_blank\">testimonials page</a> is in the process of being completely revamped.</p>\n<p>The update comes not a moment too soon, as the <a href=\"https://web.archive.org/web/20160121081904/https://wordpress.org/about/testimonials/\" target=\"_blank\">old testimonials</a> page included entries dating back to 2003 with what are now rather humorous references to b2 and Moveable Type:</p>\n<blockquote><p>I had been an avid b2 user for the last 6 months or so, but then decided to take advantage of WordPress’s features, commitment to extra development and stable codebase. So far, so good. &#8211; BC</p></blockquote>\n<blockquote><p>From my just under 24 hours of experience with WordPress, I’m a happy man. This is fantastic code, and it’s only just getting on its feet! The updates that are forthcoming promise to make this one of the premiere weblog engines on the web today. Good work! I eagerly await your future versions! — Aaron Mildenstein</p></blockquote>\n<p>Aaron Mildenstein may have been peering through a crystal ball when he wrote that testimonial 13 years ago, as WordPress now powers 25% of the web. The software and the community have changed drastically from those early days when it was still vying for legitimacy. There are now more CMS options than ever, and WordPress is the leader of the pack.</p>\n<p>Yesterday, Matt Mullenweg <a href=\"https://ma.tt/2016/01/testimonials-for-wordpress/\" target=\"_blank\">posted</a> a call for users to share what WordPress means to them using the hashtag #ilovewp on WordPress, Twitter, or Facebook.</p>\n<p>&#8220;Think of something that you love about WP that would make someone who hasn’t heard of it, or is on the fence about using it, compelled to try it out,&#8221; Mullenweg said.</p>\n<p>Twitter is filling up with heart-warming snippets of how WordPress has opened up opportunities for people to make a living and be a part of a community that is changing the web:</p>\n<blockquote class=\"twitter-tweet\" width=\"550\"><p lang=\"en\" dir=\"ltr\">My career, my livelihood, my friends and peers&#8230; I honestly owe it all to WordPress. Seriously. <a href=\"https://twitter.com/hashtag/ilovewp?src=hash\">#ilovewp</a></p>\n<p>&mdash; Mitch Canter (@thatmitchcanter) <a href=\"https://twitter.com/thatmitchcanter/status/690300103312150529\">January 21, 2016</a></p></blockquote>\n<p></p>\n<blockquote class=\"twitter-tweet\" width=\"550\"><p lang=\"en\" dir=\"ltr\">I have a fulfilling career that travels with me wherever the Army sends our family <a href=\"https://twitter.com/hashtag/ilovewp?src=hash\">#ilovewp</a> (&amp; <a href=\"https://twitter.com/10up\">@10up</a>)</p>\n<p>&mdash; Christine Garrison (@C__Garrison) <a href=\"https://twitter.com/C__Garrison/status/690566589486247936\">January 22, 2016</a></p></blockquote>\n<p></p>\n<blockquote class=\"twitter-tweet\" width=\"550\"><p lang=\"en\" dir=\"ltr\">WordPress taught me to appreciate <a href=\"https://twitter.com/hashtag/OpenSource?src=hash\">#OpenSource</a> more- and the Community fixes my broken faith in People! <a href=\"https://twitter.com/hashtag/ilovewp?src=hash\">#ilovewp</a>&#10;&#10;<a href=\"https://twitter.com/hashtag/Fight?src=hash\">#Fight</a> <a href=\"https://twitter.com/hashtag/Startup?src=hash\">#Startup</a> <a href=\"https://twitter.com/hashtag/Burnout?src=hash\">#Burnout</a></p>\n<p>&mdash; Omaar Osmaan (@Moonomo) <a href=\"https://twitter.com/Moonomo/status/690340669554995200\">January 22, 2016</a></p></blockquote>\n<p></p>\n<blockquote class=\"twitter-tweet\" width=\"550\"><p lang=\"en\" dir=\"ltr\">WordPress, serving food on our table since 2008. <a href=\"https://twitter.com/hashtag/ilovewp?src=hash\">#ilovewp</a></p>\n<p>&mdash; Emil Uzelac (@emiluzelac) <a href=\"https://twitter.com/emiluzelac/status/690344518013566978\">January 22, 2016</a></p></blockquote>\n<p></p>\n<blockquote class=\"twitter-tweet\" width=\"550\"><p lang=\"en\" dir=\"ltr\"><a href=\"https://twitter.com/hashtag/ilovewp?src=hash\">#ilovewp</a> because it taught me that tech could intersect with the arts.</p>\n<p>&mdash; Chris Rudzki (@rudzki) <a href=\"https://twitter.com/rudzki/status/690374690938998784\">January 22, 2016</a></p></blockquote>\n<p></p>\n<blockquote class=\"twitter-tweet\" width=\"550\"><p lang=\"en\" dir=\"ltr\">Community, community, community, community, community, community, community, community, community, community, community, community  <a href=\"https://twitter.com/hashtag/ilovewp?src=hash\">#ilovewp</a></p>\n<p>&mdash; Luc Princen (@LucP) <a href=\"https://twitter.com/LucP/status/690442499157028864\">January 22, 2016</a></p></blockquote>\n<p></p>\n<blockquote class=\"twitter-tweet\" width=\"550\"><p lang=\"en\" dir=\"ltr\"><a href=\"https://twitter.com/hashtag/ilovewp?src=hash\">#ilovewp</a> because it makes me feel part of a community that is making the world a better place ❤️ <a href=\"https://twitter.com/hashtag/opensource?src=hash\">#opensource</a> <a href=\"https://twitter.com/hashtag/FreedomOfExpression?src=hash\">#FreedomOfExpression</a></p>\n<p>&mdash; Stef Mattana (@stefmattana) <a href=\"https://twitter.com/stefmattana/status/690545358930366464\">January 22, 2016</a></p></blockquote>\n<p></p>\n<p>The most striking change in the testimonials today versus the early ones in 2003 is that WordPress is now much more than the sum of its distinguishing blog features. For many users, WordPress means a chance to make a living while taking care of their families and a chance to connect to a global community of people who believe in open source software.</p>\n<p>As for me, I love WordPress because it gives people a voice. It puts the power of publishing into the hands of every day people. I also appreciate that the people behind WordPress, all the way up to the very top, are defenders of free speech and <a href=\"http://wptavern.com/state-of-the-word-2015-javascript-and-api-driven-interfaces-are-the-future-of-wordpress\" target=\"_blank\">advocates of the open web</a>. Even if the technology behind the software makes radical shifts, WordPress&#8217; guiding principles are what make it a publishing platform that will stand the test of time.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 22 Jan 2016 18:07:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:13;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"Matt: Testimonials for WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=45800\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"https://ma.tt/2016/01/testimonials-for-wordpress/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:829:\"<p>One area that&#8217;s been unloved for a bit on WordPress.org is the testimonials page, it was almost funny because they were so old they talked about things people don&#8217;t even know what they are any more. Well today is a new day, <a href=\"https://wordpress.org/about/testimonials/\">on the new page we&#8217;ll be embedding snippets from WordPress, Twitter, and Facebook of people saying what WordPress has meant for them</a>. Post <a href=\"https://twitter.com/search?f=tweets&vertical=default&q=%23ilovewp&src=typd\">with the tag #ilovewp</a> and it might show up there. <img src=\"https://s.w.org/images/core/emoji/72x72/1f642.png\" alt=\"?\" class=\"wp-smiley\" /> Think of something that you love about WP that would make someone who hasn&#8217;t heard of it or is on the fence about using it compelled to try it out.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 22 Jan 2016 00:57:44 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:14;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"WPTavern: Early Bird Tickets for WooConf 2016 Now on Sale\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50878\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"http://wptavern.com/early-bird-tickets-for-wooconf-2016-now-on-sale\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3528:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/wooconf.png\" rel=\"attachment wp-att-50887\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/wooconf.png?resize=1025%2C448\" alt=\"wooconf\" class=\"aligncenter size-full wp-image-50887\" /></a></p>\n<p><a href=\"https://wooconf.com/\" target=\"_blank\">WooConf 2016</a>, a conference devoted entirely to WooCoomerce, will be held in Austin, Texas on April 6-8th. <a href=\"http://wptavern.com/wooconf-the-first-ever-conference-dedicated-to-woocommerce-deemed-a-success\" target=\"_blank\">Recaps from those who attended in 2014</a> are all agreed that this is one conference you don&#8217;t want to miss if you work with WooCommerce. The event attracts a healthy mix of entrepreneurs, developers, designers and consultants. The WooNinjas who build the platform will also be on hand with expert tips and advice. Attendees will be able to book them for 30 minute consultations throughout the day.</p>\n<p><a href=\"https://wordpress.org/plugins/woocommerce/\" target=\"_blank\">WooCommerce</a> has been downloaded more than 12 million times and is active on more than a million WordPress sites. The software is currently <a href=\"http://wptavern.com/woocommerce-dominates-global-e-commerce-platforms-passes-7-million-downloads\" target=\"_blank\">dominating global e-commerce</a>, powering roughly 30% of all online stores. WooConf 2016 will be the first WooCommerce event since <a href=\"http://wptavern.com/automattic-acquires-woocommerce\" target=\"_blank\">Automattic acquired WooThemes</a> in May 2015.</p>\n<p>More than 30 speakers will be on the schedule, including SocialMedia.org CEO Andy Sernovitz, e-commerce expert David De Boer, and Automattic CEO Matt Mullenweg.</p>\n<p>Conference organizers are holding a <a href=\"https://wooconf.com/golden-ticket/?\" target=\"_blank\">Golden Ticket contest</a> where participants who share their WooCommerce stories on Instagram have a chance to win a round-trip flight, hotel accommodation, and conference pass. More than <a href=\"https://www.instagram.com/explore/tags/wooconf/\" target=\"_blank\">350 posts</a> are already marked with the #WooConf hastag.</p>\n<blockquote class=\"instagram-media\"><div>\n<div>\n<div></div>\n</div>\n<p> <a href=\"https://www.instagram.com/p/_33f7atbPi/\" target=\"_blank\">Using WooCommerce to power your business? Built a beautiful store for a client? Share your story with us here and stand a chance to win a golden ticket to #WooConf in Austin, April 6-8 2016.  Details and Ts&amp;Cs at WooConf.com/golden-ticket/</a></p>\n<p>A video posted by WooCommerce (@woocommerce) on Dec 29, 2015 at 2:48am PST</p>\n</div>\n</blockquote>\n<p></p>\n<p>The video contest is unearthing a host of diverse ways that WooCommerce is being used around the globe, such as selling educational courses, helping children in India, selling music, and even powering a dog grooming business. If you browse the contest videos, it&#8217;s amazing to see how many different applications people have found for the WooCommerce platform.</p>\n<p>If you&#8217;re planning to attend the event, don&#8217;t wait to grab your tickets. The first WooConf in 2014 was sold out at 320 attendees and this year&#8217;s event will likely be no exception. <a href=\"https://wooconf.com/product/wooconf-2016-tickets/\" target=\"_blank\">Early bird tickets are on sale</a> for $499 through the end of January. Regular tickets will be sold for $599 until March 1st when the last minute price will go up to $699.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 22 Jan 2016 00:08:54 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:15;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"WPTavern: WPWeekly Episode 222 – iThemes Enters The Real Time Backup Space\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://wptavern.com?p=50899&preview_id=50899\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"http://wptavern.com/wpweekly-episode-222-ithemes-enters-the-real-time-backup-space\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2414:\"<p>In this short and sweet edition of WordPress Weekly, <a href=\"http://marcuscouch.com/\">Marcus Couch</a> and I discuss the latest headlines including, iThemes 8th year in business and the launch of their real time backup service, Drupal&#8217;s 15th birthday, and more. We also provide a brief status update on WordPress 4.5.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"http://wptavern.com/ithemes-announces-real-time-backup-service-stash-live\">iThemes Announces Real-time Backup Service Stash Live</a><br />\n<a href=\"http://wptavern.com/new-upvato-service-offers-free-backups-for-envato-market-products\">New Upvato Service Offers Free Backups for Envato Market Products</a><br />\n<a href=\"http://wptavern.com/happy-15th-birthday-drupal\">Happy 15th Birthday Drupal</a><br />\n<a href=\"http://wptavern.com/glotpress-is-now-available-as-a-wordpress-plugin\">GlotPress is Now Available as a WordPress Plugin</a><br />\n<a href=\"http://wptavern.com/matt-mullenweg-addresses-concerns-that-wordpress-is-moving-too-fast\">Matt Mullenweg Addresses Concerns That WordPress is Moving Too Fast</a></p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href=\"https://wordpress.org/plugins/easy-image-filters/\">Easy Image Filters</a> enables users to apply a variety of filters and effects to images stored in the Media library.</p>\n<p><a href=\"https://wordpress.org/plugins/holiday-logos/\">Holiday Logos</a> automatically changes your logo, image, background, or video based on the date.</p>\n<p><a href=\"https://wordpress.org/plugins/after-comment-prompts/\">After Comment Prompts</a> allows you to display a modal prompt after a user successfully posts a comment. Great for calls to action like social follows, product views, etc.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, Jan 27th 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"http://www.wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #222:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 21 Jan 2016 23:42:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:16;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:103:\"WPTavern: Michael Arestad Sparks Renewed Effort to Improve the Content Creation Experience in WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50847\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:113:\"http://wptavern.com/michael-arestad-sparks-renewed-effort-to-improve-the-content-creation-experience-in-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4606:\"<p>In 2013, <a href=\"https://profiles.wordpress.org/melchoyce\">Mel Choyce</a>, Design Engineer at Automattic, <a href=\"https://make.wordpress.org/design/2013/08/08/proposal-improving-the-content-editing-experience/\">published a proposal</a> to improve the content creation and editing experience in WordPress. Her proposal and associated mockups like the one below, generated a lot of discussion. However, the project lost steam and major changes to the Add New Post screen were not implemented.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2013/08/ContentEditingProposal.png\" rel=\"attachment wp-att-8380\"><img class=\"size-full wp-image-8380\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2013/08/ContentEditingProposal.png?resize=1025%2C825\" alt=\"ContentEditingProposal\" /></a>Post Writing/Editing Interface Concept From 2013\n<p>The post editor has undergone <a href=\"http://www.wpexplorer.com/history-wordpress-ui/\">numerous improvements</a> over the years from metaboxes in WordPress 2.0 to oEmbed support in 2.9. Here&#8217;s what the post editor looked like in WordPress 3.0.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/wordpress-3.0-posteditor.jpg\" rel=\"attachment wp-att-50874\"><img class=\"size-full wp-image-50874\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/wordpress-3.0-posteditor.jpg?resize=620%2C414\" alt=\"WordPress 3.0 Post Editor Interface\" /></a>WordPress 3.0 Post Editor Interface\n<p><a href=\"https://profiles.wordpress.org/michael-arestad\"> Michael Arestad</a>, Designer at Automattic, is sparking <a href=\"https://make.wordpress.org/design/2016/01/11/improving-post-new/\">renewed interest</a> to revamp the content editing and creation experience in WordPress. The project is composed of several smaller projects such as, the publishing user experience, automatic saving, the toolbar, metaboxes, and more.</p>\n<p>&#8220;A few of us have been talking about getting these projects going for a while so I wanted to see how much interest there is and how many contributors we have to work with. I am by no means leading this as much as doing what I can to get the people interested in some of these projects going on them. I’ll personally be working on some of the longer projects,&#8221; Arestad told the Tavern.</p>\n<p>A few people have already committed to parts of the project. <a class=\"mention\" href=\"https://profiles.wordpress.org/karmatosed\">Tammie Lister</a> is leading a team focused on improving the Revisions UI while Hugo Baeta is leading the <a href=\"https://core.trac.wordpress.org/ticket/27159\">Toolbar Remix</a> team.</p>\n<p>The Revisions UI project is focused on experimenting with alternative interfaces to improve user friendliness with a secondary goal of providing a way for users to quickly switch between revisions. The Toolbar Remix team will audit the toolbar in the editor and determine whether buttons should be rearranged, added, or removed.</p>\n<p>&#8220;Most of these projects will span multiple releases depending on the complexity of implementations and the number of usability tests required. There might be a few small ones that make 4.5,&#8221; Arestad said.</p>\n<p>A majority of the projects are in the beginning stages. If you&#8217;re interested in contributing to an initiative, contact Arestad on <a href=\"https://make.wordpress.org/chat/\">SlackHQ</a> or the person leading the project that interests you. You can also <a href=\"https://make.wordpress.org/design/2016/01/11/improving-post-new/\">leave feedback</a> by commenting on the proposal.</p>\n<h2>Looking Forward to Change</h2>\n<p>I work in the post editor everyday and while it&#8217;s a good experience, I want to experiment with alternative interfaces like the conceptual editor in the screenshot above. Consolidating metaboxes into the visual editor is a refreshing idea that I want to use in the real world to see if it speeds up my workflow.</p>\n<p>If I were a betting man, I&#8217;d say the Add New Post screen is the most viewed and used part of the WordPress backend. Any changes to the editor and experience will affect a large number of users as evidenced by <a href=\"http://wptavern.com/wordpress-4-4-removes-the-view-post-and-get-shortlink-buttons-from-the-post-editor\">the removal</a> of the View Post and Get Shortlink buttons in WordPress 4.4. However, any change that is implemented will likely be meticulously calculated by the core team.</p>\n<p>What changes to the Add New Post screen do you want to see that would improve the way you create content in WordPress?</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 21 Jan 2016 19:07:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:17;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"WPTavern: Jetpack 3.9 Introduces New Sitemaps Module\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50845\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"http://wptavern.com/jetpack-3-9-introduces-new-sitemaps-module\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3218:\"<p><a href=\"http://jetpack.me/2016/01/20/39-sitemaps-skype-sharing/\" target=\"_blank\">Jetpack 3.9</a> has just been released with a new module that makes it easy for users to add <a href=\"https://jetpack.me/support/sitemaps/\" target=\"_blank\">sitemaps</a> to their websites. Since <a href=\"http://www.sitemaps.org/\" target=\"_blank\">sitemaps</a> are important for SEO, many WordPress sites already have a plugin installed to create them. The new module in Jetpack will detect if you&#8217;re already using one of the popular sitemap plugins before activating.</p>\n<p>Users who prefer their current sitemaps plugin can leave the Jetpack module deactivated. As an alternative, you can remove the extra plugin and simply opt for using the one in Jetpack.</p>\n<p>The new Sitemaps module has nothing to configure. It will automatically create the following two sitemaps:</p>\n<ul>\n<li>A generic sitemap: yoursitename.com/sitemap.xml\n<li>A news sitemap: yoursitename.com/news-sitemap.xml\n</ul>\n<p>Here&#8217;s an example:</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/jetpack-sitemaps.png\" rel=\"attachment wp-att-50860\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/jetpack-sitemaps.png?resize=1025%2C744\" alt=\"jetpack-sitemaps\" class=\"aligncenter size-full wp-image-50860\" /></a></p>\n<p>The news sitemap is written specifically for publishers who want to show up in Google News. If you meet Google&#8217;s quality and technical guidelines for news sites, you can <a href=\"https://support.google.com/news/publisher/answer/40787?hl=en\" target=\"_blank\">apply to be included</a>. Upon approval, the search engine will index your site using this sitemap. It displays only posts published in the last 48 hours.</p>\n<p>Jetpack also includes two filters that allow you to add more post types to the sitemaps, since they are limited in what they display. The generic sitemap includes posts, pages, and the custom post types included in Jetpack. The news sitemap only includes posts. Check out Jetpack&#8217;s <a href=\"https://jetpack.me/support/sitemaps/\" target=\"_blank\">sitemaps documentation</a> for help customizing them.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/social-menu.png\" rel=\"attachment wp-att-50872\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/social-menu.png?resize=300%2C101\" alt=\"social-menu\" class=\"alignright size-medium wp-image-50872\" /></a>Version 3.9 of the plugin also includes a new Skype sharing button and a new <a href=\"http://jetpack.me/support/social-menu/\" target=\"_blank\">social menu</a> feature that uses  Genericons. Theme developers who want to include support for a menu that displays links to social networks can simply declare theme support and use a template tag to output the menu.</p>\n<p>This version also improves Photon&#8217;s compatibility with WordPress 4.4&#8217;s custom image sizes and the module now works seamlessly on HTTPS sites with no filter required.</p>\n<p>Jetpack 3.9 features 20 enhancements and 18 bug fixes. Check out the <a href=\"https://wordpress.org/plugins/jetpack/changelog/\" target=\"_blank\">changelog</a> for a full overview.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 21 Jan 2016 17:52:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:18;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"WPTavern: Theme Hybrid Releases Its First Commercial Plugin: Theme Designer\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50768\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"http://wptavern.com/theme-hybrid-releases-its-first-commercial-plugin-theme-designer\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4879:\"<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/colored-pencils.jpg\" rel=\"attachment wp-att-50851\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/colored-pencils.jpg?resize=1025%2C464\" alt=\"photo credit: Mari Pi\" class=\"size-full wp-image-50851\" /></a>photo credit: <a href=\"https://stocksnap.io/photo/7MBZIHU7O7\">Mari Pi</a>\n<p>After nearly eight years in business, <a href=\"http://themehybrid.com/\" target=\"_blank\">Theme Hybrid</a> has released its first commercial plugin. Up until now, all of the club&#8217;s themes and plugins have been free, but Justin Tadlock decided to try something new with the release of <a href=\"http://themehybrid.com/plugins/theme-designer\" target=\"_blank\">Theme Designer</a>, priced at $125 (with support).</p>\n<p>The price tag reflects the fact that Theme Designer targets independent theme authors, a very small niche demographic. The plugin is a theme portfolio manager with meta fields that cater to displaying theme data. It is the first of its kind and goes far beyond a traditional portfolio plugin to pull in data from WordPress.org, such as ratings, active installs, and downloads.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/theme-designer.png\" rel=\"attachment wp-att-50840\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/theme-designer.png?resize=1025%2C684\" alt=\"theme-designer\" class=\"aligncenter size-full wp-image-50840\" /></a></p>\n<p>I spoke with Tadlock to find out why he decided to make the plunge into commercial plugin development after nearly a decade of creating free products and charging for support.</p>\n<p>&#8220;From my observations, the larger WP ecosystem has changed over the years,&#8221; Tadlock said. &#8220;When I first began Theme Hybrid, people were more willing to pay for support and less willing to pay for an entire theme/plugin.</p>\n<p>&#8220;Commercial plugins were pretty much nonexistent at the time. Today, it&#8217;s a much different picture. Essentially, it&#8217;s a move that I think makes sense for my site as a business.</p>\n<p>He also said that, given the plugin&#8217;s limited audience, &#8220;There&#8217;s a finite number of people who would ever buy it. I couldn&#8217;t justify spending the development time on this as a free plugin.&#8221;</p>\n<h3>&#8220;Plugin development is where the commercial space is moving.&#8221;</h3>\n<p>Tadlock, a co-author on <a href=\"http://www.amazon.com/Professional-WordPress-Plugin-Development-Williams/dp/0470916222/\" target=\"_blank\">Professional WordPress Plugin Development</a>, is no stranger to the plugin space, but has always pursued other avenues of monetization (i.e. support and theme reviews.)</p>\n<p>&#8220;Plugin development is where the commercial space is moving,&#8221; he said. &#8220;The theme market is saturated, and there&#8217;s only so much you can do with a theme. There&#8217;s still room to innovate with themes beyond the &#8216;slider + 3 boxes + 3 boxes&#8217; design, but that&#8217;s not my primary focus right now. Plugins allow me to explore ideas that I&#8217;d never be able to explore with themes,&#8221; Tadlock said.</p>\n<p>His next product will be aimed directly at plugin developers with a good deal of crossover on features from Theme Designer.</p>\n<p>&#8220;They&#8217;ll share much of the same UI,&#8221; Tadlock said. &#8220;The WordPress.org Plugins API integration should be a little deeper. Plugin devs have extra info they can add with their <code>readme.txt</code> file.</p>\n<p>&#8220;I&#8217;ve still got a bunch of research left though. With Theme Designer, I looked at all the major theme businesses like StudioPress, WooThemes, ThemeForest, and many more. So, I&#8217;ll need to do the same for plugins,&#8221; he said.</p>\n<p>With hundreds, or perhaps thousands of theme sellers out there, it&#8217;s surprising that the WordPress product space doesn&#8217;t already have more tools for showcasing their work. The theme market has long since matured to the point of sellers needing their own specialized tools. Every shop seems to end up building or adapting its own solution in-house. Tadlock is hoping that introducing commercial plugins like Theme Designer will expand Theme Hybrid&#8217;s user base.</p>\n<p>&#8220;In the long run, it should bring in a wider audience of users,&#8221; he said. &#8220;One thing I&#8217;ve noticed over the past couple of years is that more people have already been signing up for plugin support, so the site&#8217;s audience is already in a transitioning phase.&#8221;</p>\n<p>Tadlock still plans to build free plugins and themes in addition to the new commercial offerings. &#8220;I don&#8217;t see that changing any time soon,&#8221; he said. &#8220;I&#8217;ll still build free plugins and themes, so that&#8217;s not changing.&#8221;</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 20 Jan 2016 23:41:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:19;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"WPTavern: WP Valet Rebrands Multimillion Dollar WordPress Support Business\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50814\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"http://wptavern.com/wp-valet-rebrands-multimillion-dollar-wordpress-support-business\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6325:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/valet-logo.png\" rel=\"attachment wp-att-50824\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/valet-logo.png?resize=1025%2C385\" alt=\"valet-logo\" class=\"aligncenter size-full wp-image-50824\" /></a></p>\n<p>When Mason James hired his first contractor and launched <a href=\"http://www.valet.io/\" target=\"_blank\">WP Valet</a> in 2012, scaling up wasn&#8217;t part of his master plan. He knew he couldn&#8217;t do it alone but couldn&#8217;t imagine having more than a small team. His first contractor, Kim Lipari, became a partner and helped to bring in more customer requests than they knew how to handle. Four years later, the team is now 10 employees and 6 full-time contractors, and the company is hiring aggressively to fill more positions.</p>\n<p>Today WP Valet is dropping the &#8220;WP&#8221; from its name and <a href=\"http://www.valet.io/we-are-valet/\" target=\"_blank\">rebranding as Valet</a>. The company started out providing monthly professional services and support for WordPress website owners, but expanded to take on more client work after acquiring a local design agency.</p>\n<p>&#8220;In 2014, EasilyAmused merged with us and we acqui-hired their team,&#8221; James said. &#8220;James Tryon came on board as our Creative Director to continue leading this team. This made a huge difference as it doubled our team size and allowed us to provide a much higher level of design and development.&#8221;</p>\n<p>The rebranding announced today is a reflection of Valet&#8217;s expanded services. &#8220;We&#8217;re still 100% built on and using WordPress and think it&#8217;ll be an integral part of websites for a long, long time to come,&#8221; James said. &#8220;But we want to expand our customer reach as well.</p>\n<p>&#8220;Our services are centered around best practices that are applicable to all websites &#8211; regardless of their platform. And finally, our customer needs include branding, design, strategy, and a ton of other things that don&#8217;t specifically require WordPress. The new Valet brand provides us room to have these discussions.&#8221;</p>\n<p>Growing the team to take on more custom development, in addition to monthly website support services, has paid off for Valet, which is now a multimillion dollar company.</p>\n<p>&#8220;We&#8217;ve seen steady growth since we started in 2012,&#8221; James said. &#8220;We&#8217;re proud to be a grassroots startup with no funding or investors.</p>\n<p>&#8220;Our revenue is split pretty evenly between monthly support and individual custom development/design projects. Part of our rebranding goals was to line up our presentation with what we really do today.</p>\n<p>&#8220;While migrations made up a third of our revenue in the first year, it now accounts for less than an eighth! Overall our revenue is in the millions, though closer to 10M than to 100M. Year-over-year revenue growth increased about 45% in 2015.&#8221;</p>\n<h3>Raising the Bar on Support</h3>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/wp-valet-team.jpg\" rel=\"attachment wp-att-50825\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/wp-valet-team.jpg?resize=920%2C421\" alt=\"wp-valet-team\" class=\"aligncenter size-full wp-image-50825\" /></a></p>\n<p>As Valet continues to scale its support services team, James is on a mission to change the WordPress support niche. When the company was first starting out, they became well known for handling migrations and maintenance.</p>\n<p>&#8220;We reached out to a couple of companies and asked if we could do some migrations for them,&#8221; James said. &#8220;We wanted to better understand their setup and expectations. This resonated well with a few of those companies and we ended up doing thousands of migrations, growing the team to four people who exclusively handled migrations on a day-to-day basis.&#8221;</p>\n<p>However, James never aimed for WP Valet to be a migrations and maintenance company and is determined to reshape customer thinking about monthly support.</p>\n<p>&#8220;The truth is, WP Valet was founded on the idea of ongoing professional services,&#8221; he said. &#8220;It was never meant to be specific to migrations or maintenance. The real passion was to make sure website owners had all the strategy, insights, and support they needed to operate in the month-to-month requirements of running a business.&#8221;</p>\n<p>James is hoping to change the support niche so as not to perpetuate the idea of &#8220;maintenance&#8221; to customers. He said that he doesn&#8217;t like the word and avoids it on purpose.</p>\n<p>&#8220;Most of our customers are not &#8216;brochure sites&#8217; with WordPress,&#8221; he said. &#8220;They&#8217;re businesses. They rely on their sites to help create revenue.</p>\n<p>&#8220;I frequently tell our potential clients, <em>&#8216;Maintenance is fine for your dishwasher, but your business should always be pursuing growth!&#8217;</em> We do this by creating real, targeted metrics for our clients across several key areas of site performance and provide them with the ability to see these stats at any time. More than that, we work pro-actively to make sure key areas like site speed and traffic are improving without the client needing to open a specific request.&#8221;</p>\n<p>The Valet team plans to focus on performance benchmarking this year while continuing to support the monthly needs of their customers. According to James, 50% of their revenue still comes from the regular monthly support plans. Balancing the rapid growth of the support team while managing projects as a full service agency is a delicate balancing act.</p>\n<p>&#8220;Growth and scaling are absolutely terrifying,&#8221; James said. &#8220;When people ask me about how fast we scale, I respond with something along the lines of &#8216;as much as we can without me lying in the fetal position under the piano in the den.&#8217;</p>\n<p>&#8220;I&#8217;ve found that it&#8217;s more natural for me to identify and take action on failure then it is to measure success,&#8221; he said. &#8220;Finding success can leave me with a &#8216;now what?&#8217; feeling so I&#8217;m learning to enjoy the moments and victories on the ride.&#8221;</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 20 Jan 2016 17:48:54 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:20;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"WPTavern: iThemes Announces Real-time Backup Service Stash Live\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50805\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://wptavern.com/ithemes-announces-real-time-backup-service-stash-live\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1582:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/StashLiveLogo.png\" rel=\"attachment wp-att-50808\"><img class=\"aligncenter size-full wp-image-50808\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/StashLiveLogo.png?resize=725%2C325\" alt=\"Stash Live Banner\" /></a><a href=\"https://ithemes.com/\">iThemes</a>, a WordPress company that&#8217;s celebrating eight years in business this month, is announcing a new add-on called <a href=\"https://ithemes.com/2016/01/19/our-next-wordpress-game-changer-is-coming/\">Stash Live</a> which will be part of BackupBuddy 7.0. Similar to <a href=\"https://vaultpress.com/\">VaultPress</a>, Stash Live is a service that will enable users to perform real-time backups.</p>\n<p>Both the database and files will be streamed to the service where you can create a snapshot. The snapshot includes, a site&#8217;s database, files, plugins, and themes. Users will be able to download the .ZIP file or keep it on Stash Live and use it as an off-site backup storage location.</p>\n<p>In addition to performing real-time backups, Stash Live offloads the processing power used to create them making it friendly to shared webhosting environments. BackupBuddy 7.0 is currently in the beta testing phase that iThemes plans to release soon. Customers with an active subscription will receive access to the service for free.</p>\n<p>For an inside look at what&#8217;s coming in BackupBuddy 7.0, including a preview of Stash Live, check out this 43 minute walkthrough.</p>\n<div class=\"embed-wrap\"></div>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 20 Jan 2016 08:30:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:21;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"WPTavern: Matt Mullenweg Addresses Concerns That WordPress is Moving Too Fast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50762\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"http://wptavern.com/matt-mullenweg-addresses-concerns-that-wordpress-is-moving-too-fast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4193:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/08/RoadRunnerFeaturedImage.png\" rel=\"attachment wp-att-28853\"><img class=\"size-full wp-image-28853\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/08/RoadRunnerFeaturedImage.png?resize=639%2C260\" alt=\"RoadRunner Featured Image\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/steevithak/3292372292/\">steevithak</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-sa/2.0/\">cc</a>\n<p>There are at least <a href=\"https://wordpress.org/about/philosophy/\">three major releases</a> of WordPress per year where users can expect new features and major bug fixes about every four months. While this is great for users, some companies, plugin, and theme developers are struggling to keep up.</p>\n<p>We recently received the following email from a reader concerned with WordPress&#8217; release strategy:</p>\n<blockquote><p>As the pace of WordPress releases grows, plugin and theme developers have to constantly update their products. This is leading to a real and growing problem among WordPress site owners and companies like mine that handle website maintenance and updating.</p>\n<p>This pace is leading to an almost daily need to fix problems, caused by these updates. Plugin updates tend to break things, even though we primarily use professional, paid plugins for the idea of support and generally better quality products.</p>\n<p>I get that it&#8217;s important to patch security issues, but we&#8217;re also seeing a lot of new functionality, moving plugins into core, and other changes. These cause theme developers to push out updates with great frequency and they make mistakes.</p>\n<p>I&#8217;m worried that the pace of core updates is driving the larger ecosystem toward failure. Everyone is scrambling to keep things patched, then new conflicts arise and things break down. The person on the end &#8216;companies maintaining their sites, responsibly, or services like mine&#8217; face a constant flow of updates, then testing, then trying to fix things that have broken.</p></blockquote>\n<p>Matt Mullenweg, Co-founder of the WordPress open source software project, specifically addressed this issue during the Q&amp;A session of the 2015 State of the Word at WordCamp US. Mika Epstein, who voluntarily reviews and approves plugins for the WordPress plugin directory, voiced the concerns shared by developers who are struggling to keep up.</p>\n<p>With the myriad of technologies developers have to learn, including the REST API and JavaScript, Epstein asked Mullenweg if WordPress is moving too fast and if the number of releases per year should decrease by one.</p>\n<div class=\"embed-wrap\"></div>\n<p>Mullenweg answered the question by saying improvements can be made to the plugin directory so that users can share the burden in the testing process. He also said that the speed of WordPress development will increase instead of decrease. Meanwhile, the development team will continue to release three major versions per year.</p>\n<p>He then describes a future where developers may be able to lessen their support burden by using the REST API that&#8217;s slated for WordPress 4.5. He also cites how large webhosting companies, such as Bluehost, have automatically upgraded most of the WordPress sites on their network to the latest stable version. Mullenweg ends his response by apologizing to those who feel WordPress is moving too fast but says its worked so far.</p>\n<h2>How Do You Keep Up With WordPress?</h2>\n<p>While we do a great job of keeping users and developers informed, plugin and theme authors should subscribe to the <a href=\"http://make.wordpress.org/plugins/\">Make Plugins</a> and <a href=\"http://make.wordpress.org/themes/\">Make Themes</a> sites respectively. Anyone involved with maintaining WordPress sites should subscribe to the <a href=\"http://make.wordpress.org/core/\">Make Core</a> site where important information related to core is published.</p>\n<p>We know that the release strategy isn&#8217;t going to change so whether you&#8217;re a developer or someone in charge of maintaining sites, how are you keeping up with WordPress?</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 19 Jan 2016 23:45:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:22;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"WPTavern: JoomlaDay Florida Invites WordPress Developers to Attend\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50546\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"http://wptavern.com/joomladay-florida-invites-wordpress-developers-to-attend\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3129:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/joomla-day-florida.png\" rel=\"attachment wp-att-50771\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/joomla-day-florida.png?resize=1025%2C474\" alt=\"joomla-day-florida\" class=\"aligncenter size-full wp-image-50771\" /></a></p>\n<p>Last year Jenny Wong and Aaron Jorbin challenged the WordPress community to <a href=\"http://wptavern.com/venturing-outside-the-bubble-wordpress-community-members-attend-php-uk-2015-conference\" target=\"_blank\">venture outside the WordPress bubble</a> after speaking at PHP UK 2015. Both were enriched by the experience of connecting across technology communities and challenging others&#8217; expectations of WordPress.</p>\n<p>If you&#8217;re in the Tampa area and looking to branch out to some non-WordCamp conferences, the first annual <a href=\"http://www.joomladayflorida.com/\" target=\"_blank\">JoomlaDay Florida</a> is happening on February 27th, 2016. WordPress developers in Florida have the opportunity to connect with the Joomla community at the invitation of the organizers. The event website includes a page with a <a href=\"http://www.joomladayflorida.com/about-joomladay-florida/wordpress-developers\" target=\"_blank\">special invitation to WordPress developers</a>:</p>\n<blockquote><p>The first annual JoomlaDay Florida is not only for Joomla enthusiasts, WordPress developers will also find the conference educational and informative. No matter what your skill level, we have some very interesting speakers and session on PHP, Joomla, WordPress and Open Source Software.</p></blockquote>\n<p>Speakers include <a href=\"http://www.joomladayflorida.com/speakers/746-cal-evans\" target=\"_blank\">Cal Evans</a>, Technical Manager and head of Training and Certification at Zend Technologies. Evans is well known in the PHP community and has been working with PHP and MySQL on Linux, OSX, and Windows for the past 15 years. He will be giving a session on PHP 7 along with an afternoon keynote.</p>\n<p>Peter Konstantakos, an agency owner who specializes in both Joomla and WordPress, will be conducting <a href=\"http://www.joomladayflorida.com/speakers-schedule/event/5-cms-migration\" target=\"_blank\">a workshop on migrating between the platforms</a>. He will also cover topics like how to migrate between popular extensions like Virtuemart to WooCommerce.</p>\n<p>The event schedule includes presentations on Joomla tools and workflows, building applications, contributing to open source projects, and a <a href=\"http://www.joomladayflorida.com/speakers-schedule/event/36-state-of-joomla-tessa-mero\" target=\"_blank\">State of Joomla</a> address from <a href=\"https://twitter.com/TessaMero\" target=\"_blank\">Tessa Mero</a>. Tickets are just $35, comparable to a WordCamp, and include breakfast, lunch, swag, and access to the after party where you can network with Joomla professionals and enthusiasts. If you plan to attend, don&#8217;t wait to <a href=\"http://www.joomladayflorida.com/register-now\" target=\"_blank\">purchase your ticket</a>, because they are already 95% sold.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 19 Jan 2016 22:24:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:23;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"WPTavern: GlotPress is Now Available as a WordPress Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50723\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"http://wptavern.com/glotpress-is-now-available-as-a-wordpress-plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2994:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/glotpress.png\" rel=\"attachment wp-att-50746\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/glotpress.png?resize=1025%2C453\" alt=\"glotpress\" class=\"aligncenter size-full wp-image-50746\" /></a></p>\n<p><a href=\"http://blog.glotpress.org/2016/01/19/glotpress-1-0-bunsen-honeydew/\" target=\"_blank\">GlotPress 1.0</a> “Bunsen Honeydew” was released yesterday. In June 2015, Andrew Nacin began the work of transforming GlotPress into a plugin with a <a href=\"https://github.com/GlotPress/GlotPress-WP/commit/d9d47271c6ce0c8e3d927088853ac47c1d100561\" target=\"_blank\">first pass</a> that switched it from using the BackPress external to a WordPress install. Dominik Schilling led the development on GitHub, which included <a href=\"https://github.com/GlotPress/GlotPress-WP/compare/d9d47271...d0a12dc035\" target=\"_blank\">352 commits</a> and fixes for <a href=\"https://github.com/GlotPress/GlotPress-WP/issues?utf8=%E2%9C%93&q=milestone%3A1.0+is%3Aissue\" target=\"_blank\">70 issues</a>.</p>\n<p>&#8220;For the first version the goal was to change as little as possible to get it working well,&#8221; Schilling said in the release announcement. &#8220;But still we had to remove some things in favor of WordPress&#8217; API system.&#8221;</p>\n<p>Version 1.0 includes the following:</p>\n<ul>\n<li>It’s a plugin!</li>\n<li>WP-CLI support</li>\n<li>Integrated with WordPress’ user system</li>\n<li>Easy installation through the WordPress.org plugin directory</li>\n<li>Multisite support</li>\n</ul>\n<p>If you have a customized GlotPress install and you want to switch to the new WordPress plugin, you will want to review the plugin&#8217;s wiki to take stock of the <a href=\"https://github.com/GlotPress/GlotPress-WP/wiki/1.1-Breaking-Changes\" target=\"_blank\">breaking changes</a>. Contributors have also written a guide to <a href=\"https://github.com/deliciousbrains/GlotPress/wiki/1.2-Converting-Plugins\" target=\"_blank\">converting plugins</a> for the standalone version to use the WordPress plugin infrastructure.</p>\n<p>Having GlotPress available as a plugin makes it much easier to use and update. The standalone version had a more complicated installation and configuration process, but it was worth it for the collaboration capabilities that it offered. All this can now be added to any WordPress site with the click of a button.</p>\n<p>The <a href=\"https://wordpress.org/plugins/glotpress/\" target=\"_blank\">GlotPress plugin</a> is now available for download on WordPress.org and includes a beautiful newly designed plugin icon and banner. An <a href=\"https://github.com/GlotPress/GlotPress-WP/wiki/2.-Branding-and-Logos\" target=\"_blank\">official branding guide</a> is also available thanks to Hugo Baeta and other contributors. You can follow the plugin&#8217;s development and <a href=\"https://github.com/GlotPress/GlotPress-WP\" target=\"_blank\">contribute on GitHub</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 19 Jan 2016 18:28:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:24;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"WPTavern: GitLab Courts Open Source Project Maintainers with Response to “Dear GitHub” Letter\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50713\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:101:\"http://wptavern.com/gitlab-courts-open-source-project-maintainers-with-response-to-dear-github-letter\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4578:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/gitlab.png\" rel=\"attachment wp-att-50741\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/gitlab.png?resize=1025%2C371\" alt=\"gitlab\" class=\"aligncenter size-full wp-image-50741\" /></a></p>\n<p>The makers of GitLab are attempting to capitalize on the current situation at GitHub where open source project maintainers have publicized their frustrations with issue management. Last week, project maintainers <a href=\"http://wptavern.com/open-source-project-maintainers-confront-github-with-open-letter-on-issue-management\" target=\"_blank\">published a letter called &#8220;Dear GitHub&#8221;</a> that outlines their concerns and the solutions they hope to see implemented.</p>\n<p>GitHub has not officially responded to these concerns, apart from a new Director of Community dropping <a href=\"https://news.ycombinator.com/item?id=10905338\" target=\"_blank\">a note on Hacker News</a> to recognize the feedback with a disclaimer that he is &#8220;still figuring out how GitHub fits together as an organization but&#8230; happy to take a look into these issues and ensure they are considered in how future work is planned.&#8221;</p>\n<p>GitLab, on the other hand, wasted no time in addressing the group&#8217;s concerns in a <a href=\"https://about.gitlab.com/2016/01/15/making-gitlab-better-for-large-open-source-projects/\" target=\"_blank\">post</a> that begins, &#8220;Dear open source maintainers:&#8221;</p>\n<blockquote><p>We want GitLab to be the best place for any software project, whether open source or not, whether big or small.</p>\n<p><a href=\"https://github.com/dear-github/dear-github\" target=\"_blank\">The letter of GitHub’s open source community</a> is clearly not addressed to us, but we’re thinking a lot about the issues that were mentioned in it. We see many of these things happening and have been working on them for a long time, not in the least because we develop on <a href=\"https://gitlab.com/gitlab-org/gitlab-ce/issues\" target=\"_blank\">a busy public issue tracker</a> ourselves.</p></blockquote>\n<p>GitLab, which already allows project maintainers to <a href=\"https://gitlab.com/gitlab-org/gitlab-ee/blob/master/doc/customization/issue_and_merge_request_template.md\" target=\"_blank\">set a template for an issue and for merge requests</a>, is planning on adding <a href=\"https://gitlab.com/gitlab-org/gitlab-ee/issues/101\" target=\"_blank\">multiple templates</a>, and is strongly considering the suggestion of <a href=\"https://gitlab.com/gitlab-org/gitlab-ce/issues/8988\" target=\"_blank\">custom fields</a>. A new <a href=\"https://gitlab.com/gitlab-org/gitlab-ce/issues/9088\" target=\"_blank\">issue</a> has been created to track discussion and progress on the possibility of using a new_issue.md file for templates.</p>\n<p><a href=\"https://twitter.com/Jobvo\" target=\"_blank\">Job van der Voort</a>, VP of Product at GitLab, addressed every concern mentioned in the open letter to GitHub. He highlighted the fact that<br />\nGitLab already has a voting system that transforms +1s into votes and noted plans for improving the placement of CONTRIBUTING.md at the top of issues screens.</p>\n<p>Van der Voort also created a new issue for the GitLab Community Edition called &#8220;<a href=\"https://gitlab.com/gitlab-org/gitlab-ce/issues/8938\" target=\"_blank\">Making GitLab the best place for big open source projects</a>.&#8221; This issue is now home to a long list of of frustrations and suggestions that were included in the original letter to GitHub. Van der Voort and contributors have responded to every single point and have created new issues for improving GitLab where necessary.</p>\n<p>After just four days, the <a href=\"https://github.com/dear-github/\" target=\"_blank\">Dear GitHub</a> letter has received more than 1,100 signatures from open source project maintainers. Although the authors have received no official response from GitHub, the letter has sparked some healthy discussions around the web about how code hosting services can better serve their open source communities.</p>\n<p>Both GitHub and GitLab have built their reputations and business on supporting open source software, <a href=\"http://www.wired.com/2015/08/github-data-shows-changing-software-landscape/\" target=\"_blank\">which has now become mainstream</a> and more easily adopted by enterprises. Open source software runs the world. No code hosting site that aims to be the leader can afford to ignore the requests of open source project maintainers for long.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 19 Jan 2016 05:34:16 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:25;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"WPTavern: Atom Editor Package Adds Autocomplete for WordPress Actions and Filters\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50670\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"http://wptavern.com/atom-editor-package-adds-autocomplete-for-wordpress-actions-and-filters\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2759:\"<p>Nearly two years ago, <a href=\"https://github.com/blog/1831-atom-free-and-open-source-for-everyone\" target=\"_blank\">GitHub open sourced Atom</a>, its new JavaScript-powered text editor. GitHub designed Atom to be extensible, which has helped to quickly grow its adoption around the web. Developers at Facebook used it to make <a href=\"http://nuclide.io/\" target=\"_blank\">Nuclide</a>, an entire suite of Atom packages that create the first IDE with <a href=\"http://nuclide.io/docs/hack/\" target=\"_blank\">support for Hack development</a>. The folks at Nylas are in the process of <a href=\"https://www.nylas.com/blog/splitting-the-atom\" target=\"_blank\">forking Atom to create a fast, flexible mail client</a>, thanks to Atom&#8217;s &#8220;solid foundation for JavaScript on the desktop, and its application code.&#8221;</p>\n<p>There are currently <a href=\"https://atom.io/packages\" target=\"_blank\">3,496 packages available to extend Atom</a>, including one that offers <a href=\"https://atom.io/packages/autocomplete-wordpress-hooks\" target=\"_blank\">autocomplete for WordPress hooks</a>. <a href=\"https://twitter.com/joe_hoyle\" target=\"_blank\">Joe Hoyle</a>, co-founder of <a href=\"https://hmn.md/\" target=\"_blank\">Human Made</a> and contributor on the WP REST API project, is the author of the package, which has been downloaded 1,295 times to date. As you&#8217;re typing in Atom, WordPress actions and filters appear as a dropdown with short descriptions for each.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/wp-autocomplete-atom.gif\" rel=\"attachment wp-att-50672\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/wp-autocomplete-atom.gif?resize=733%2C371\" alt=\"wp-autocomplete-atom\" class=\"aligncenter size-full wp-image-50672\" /></a></p>\n<p>Packages published to Atom.io are available for installation via the Preferences > Settings > Install menu. Simply visit this screen and search for &#8220;autocomplete-wordpress-hooks&#8221; to add the package to your editor.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/atom-install-packages.png\" rel=\"attachment wp-att-50703\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/atom-install-packages.png?resize=1025%2C341\" alt=\"atom-install-packages\" class=\"aligncenter size-full wp-image-50703\" /></a></p>\n<p>If you find any bugs with the package, you can report them on the <a href=\"https://github.com/joehoyle/atom-autocomplete-wordpress-hooks/issues\" target=\"_blank\">Autocomplete WordPress Hooks GitHub repository</a>. For more open source packages related to WordPress development, check out the <a href=\"https://atom.io/packages\" target=\"_blank\">Atom.io package library</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 18 Jan 2016 20:19:04 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"Dougal Campbell: WordPress, PHP7, and Updates via php-ssh2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"http://dougal.gunters.org/?p=81089\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"http://dougal.gunters.org/blog/2016/01/18/wordpress-php7-and-updates-via-php-ssh2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4249:\"<p>TL;DR: If you use the php-ssh2 extension for your WordPress core / theme / plugin updates, you might want to wait a little longer before upgrading to PHP 7.</p>\n<p>Last month, one of my VPS servers suffered a catastrophic disk failure, taking down several personal websites that my wife and I manage. All of our WordPress content is on a separate database server, so the main content is still intact. I&#8217;ve also been able to extract a <em>few</em> things from a raw image of the damaged drive.  But there were some things (site-specific plugins, child-themes, media content, utility scripts, my email archives) which are likely gone for good, or that will at least be painful to put back into place (uploaded images, etc.).</p>\n<p>There&#8217;s not much use crying over spilt milk, though, so I at least saw this as an opportunity to freshen up and improve upon my previous server configuration. In its previous incarnation, I had been running Apache workers, and PHP-FPM (PHP 5.6.x). But I also had some web experiments in Nodejs, which I had to run on a non-standard port, so as to not conflict with Apache. Since I was starting from scratch anyways, I&#8217;ve decided to put HAProxy in front of everything, so that I can internally run multiple web servers, and just proxy to them transparently. And while I was at it, I&#8217;ve been hearing a lot of good things about the speed improvements in PHP 7, so I figured I&#8217;d upgrade that, as well.</p>\n<p>I won&#8217;t go into the nitty-gritty details of my install (especially since I&#8217;m not finished yet), but I did want to let others know about a problem I&#8217;ve run into: There is a new development build of the php-ssh2 extension for PHP 7, but it is not quite complete yet. Many things do work, but unfortunately, all of the functions which rely on the ability to use the <code>stat()</code> call are broken at this time. This includes other file-checking functions such as <code>is_dir()</code>, and <code>is_file()</code>, <code>file_exists()</code>. In WordPress, if you are using the SSH2 filesystem class (rather than FTP or FTPS), this will prevent you from using the built-in plugin and theme installers, or any of the automatic upgrade functionality.</p>\n<p>After digging around in the php-ssh2 extension source code for a while and comparing to a previous version, I was unable to find the problem myself. My C programming is too rusty, and I just don&#8217;t have the time to start learning PHP and libssh2 internals from scratch. But, I did <a href=\"https://bugs.php.net/bug.php?id=71376\">file a bug on the PHP Bugtracker</a>, and the author of the PHP 7 port of the php-ssh2 extension has said that he is working on a fix. So keep an out out for an update on that.</p>\n<p>Just as a side-note, using fstat() on a filehandle opened on an ssh2.sftp file resource, or using the ssh2_sftp_stat() call do work. But that doesn&#8217;t help with the is_dir() and is_file() calls which are failing in the class-wp-filesystem-ssh2.php code. Those functions rely on the PHP internal ssh2.sftp stream wrappers.</p>\n<p>Postscript: I know plenty of people will say, &#8220;You should have had backups!&#8221; or even, &#8220;Your VPS host must suck for not having backups!&#8221;. The former is absolutely true &#8212; I should have done better at backing up some of the things that I did not have backups for. The VPS host is not really to blame. I had gotten a disk size upgrade, and I actually had an opportunity to request a snapshot of my system before I ran the upgrade process to extend my disk. But because I had run it successfully on another server without incident, I got careless. And after the upgrade, the system seemed to run fine for about three weeks before any problems surfaced.</p>\n<p>Original Article: <a rel=\"nofollow\" href=\"http://dougal.gunters.org/blog/2016/01/18/wordpress-php7-and-updates-via-php-ssh2/\">WordPress, PHP7, and Updates via php-ssh2</a><br />\n<a rel=\"nofollow\" href=\"http://dougal.gunters.org\">Dougal Campbell&#039;s geek ramblings - WordPress, web development, and world domination.</a></p>\n<div class=\"yarpp-related-rss yarpp-related-none\">\n<img src=\"http://yarpp.org/pixels/5db43ee24c4f1e1d0e45d08cc91b0130\" alt=\"YARPP\" />\n</div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 18 Jan 2016 18:14:11 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Dougal Campbell\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:27;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"WPTavern: WPShout’s 2016 Webhosting Survey Results Show Specialized Hosts Are Doing Well\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50665\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"http://wptavern.com/wpshouts-2016-webhosting-survey-results-show-specialized-hosts-are-doing-well\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2889:\"<p>WPShout has <a href=\"http://wpshout.com/wordpress-hosting-review-2016-results/\">published the results</a> of its 2016 <a href=\"http://wptavern.com/wpshout-is-accepting-submissions-for-its-2016-webhosting-survey\">webhosting survey</a> taken by 135 respondents. The results from this year&#8217;s survey show two trends.</p>\n<p>First, average monthly spending increased sharply from last year. WPShout attributes the increase to either people spending more money on hosting or a different demographic taking the survey. Second, EIG owned hosts as a group scored poorly across the board, especially A Small Orange which was acquired in 2012.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/EIGHosts2016SurveyResults.png\" rel=\"attachment wp-att-50668\"><img class=\"size-full wp-image-50668\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/EIGHosts2016SurveyResults.png?resize=539%2C355\" alt=\"Survey Results for EIG Owned Hosts\" /></a>Survey Results for EIG Owned Hosts\n<p>A Small Orange received accolades in <a href=\"http://wpshout.com/wordpress-hosting-review-2014-results/\">the 2014 survey</a> but multiple outages in 2015 increased customer dissatisfaction.</p>\n<p>GoDaddy&#8217;s results improved over last year but it still scores below other companies. In particular, customers commented that its managed WordPress offering is superior to its other hosting options.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/GoDaddy2016Results.png\" rel=\"attachment wp-att-50675\"><img class=\"size-full wp-image-50675\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/GoDaddy2016Results.png?resize=534%2C363\" alt=\"GoDaddy 2016 Survey Results\" /></a>GoDaddy 2016 Survey Results\n<p>Specialized webhosts continued their streak of doing well in the survey. Among the hosts that scored well across the board are Flywheel, Digital Ocean, Kinsta, and WP Engine.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/SpecializedHostingResults.png\" rel=\"attachment wp-att-50678\"><img class=\"size-full wp-image-50678\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/SpecializedHostingResults.png?resize=531%2C393\" alt=\"Specialized Hosting Results\" /></a>Specialized Hosting Results\n<p>I encourage you to read WPShout&#8217;s <a href=\"http://wpshout.com/wordpress-hosting-review-2016-results/\">thorough breakdown</a> of the results, trends noticed, and comments from respondents. Keep in mind that 135 people is a small sample size and therefore, the survey should not be used exclusively to make purchasing decisions.</p>\n<p>If you need help selecting a WordPress hosting provider, check out <a href=\"https://chrislema.com/selecting-a-wordpress-hosting-provider/\">this recent post</a> by Chris Lema which includes 10 questions you should ask before choosing a host.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 18 Jan 2016 17:48:30 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:28;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"Matt: Bitcoin Trouble\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=45795\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"https://ma.tt/2016/01/bitcoin-trouble/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:378:\"<p>Mike Hearn has a great and <a href=\"https://medium.com/@octskyward/the-resolution-of-the-bitcoin-experiment-dabb30201f7#.8kturuice\">thought-provoking post on why he thinks Bitcoin is at a developer-caused impasse, and he&#8217;s ending his participation</a>. I ended up selling most of my Bitcoin last year, but if I hadn&#8217;t this would definitely make me reconsider.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 16 Jan 2016 14:40:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:29;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"WPTavern: Open Source Project Maintainers Confront GitHub with Open Letter on Issue Management\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50603\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:104:\"http://wptavern.com/open-source-project-maintainers-confront-github-with-open-letter-on-issue-management\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6580:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/04/github-octocat.jpg\" rel=\"attachment wp-att-42456\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/04/github-octocat.jpg?resize=857%2C400\" alt=\"github-octocat\" class=\"aligncenter size-full wp-image-42456\" /></a></p>\n<p>A zealous cadre of open source project maintainers is hoping to inspire change at GitHub by publicizing their complaints regarding issue management. After pursuing official channels without receiving a response, the group&#8217;s members say that they are frustrated by a lack of communication:</p>\n<blockquote><p>Those of us who run some of the most popular projects on GitHub feel completely ignored by you. We’ve gone through the only support channel that you have given us either to receive an empty response or even no response at all. We have no visibility into what has happened with our requests, or whether GitHub is working on them.</p></blockquote>\n<p>Authors of the &#8220;<a href=\"https://github.com/dear-github/\" target=\"_blank\">Dear GitHub</a>&#8221; repository, which has no public members, collectively penned <a href=\"https://github.com/dear-github/dear-github\" target=\"_blank\">an earnest letter</a> that outlines three critical problems they perceive with the way issues currently work.</p>\n<p>The first problem the group states is a lack of features for GitHub issues, and they propose a simple solution:</p>\n<blockquote><p>Issues are often filed missing crucial information like reproduction steps or version tested. We’d like issues to gain custom fields, along with a mechanism (such as a mandatory issue template, perhaps powered by a newissue.md in root as a likely-simple solution) for ensuring they are filled out in every issue.</p></blockquote>\n<p>The group is also calling for GitHub to create a &#8220;first-class voting system&#8221; that would declutter the ubiquitous &#8220;+1&#8243;&#8216;s that litter nearly every popular project&#8217;s issues queue. They recognize the +1s as important feedback but demand a better UI to organize this information:</p>\n<blockquote><p>Issues often accumulate content-less “+1” comments which serve only to spam the maintainers and any others subscribed to the issue. These +1s serve a valuable function in letting maintainers know how widespread an issue is, but their drawbacks are too great. We’d like issues to gain a first-class voting system, and for content-less comments like “+1” or “:+1:” or “me too” to trigger a warning and instructions on how to use the voting mechanism.</p></blockquote>\n<p>The third issue directly impacts the open source workflow, which becomes inefficient when issues and requests are improperly submitted. The proposed solution streamlines important information that guides users toward submitting meaningful contributions:</p>\n<blockquote><p>Issues and pull requests are often created without any adherence to the CONTRIBUTING.md contribution guidelines, due to the inconspicuous nature of the “guidelines for contributing” link when creating an issue and the fact that it often contains a lot of information that isn’t relevant to opening issues (such as information about hacking on the project). Maintainers should be able to configure a file in the repo (interpreted as GFM) to be displayed at the top of the new issue / PR page instead of that link. Maintainers can choose to inline content there and / or link to other pages as appropriate.</p></blockquote>\n<p>Authors of the letter have waited years for progress on these issues. The <a href=\"https://docs.google.com/spreadsheets/d/1oGsg02jS-PnlIMJ3OlWIOEmhtG-udTwuDz_vsQPBHKs/htmlview?usp=sharing&sle=true\" target=\"_blank\">600+ project maintainers who have signed the document</a> are incapable of making these changes themselves, since GitHub&#8217;s infrastructure is not open source.</p>\n<h3>GitHub&#8217;s Paying Customers Don&#8217;t Share the Same Problems as Open Source Project Maintainers</h3>\n<p>With more than <a href=\"https://github.com/about/press\" target=\"_blank\">12 million people collaborating across 31 million repositories</a> as of January 2015, GitHub is home to the largest collection of code on the planet. Its emphasis on &#8220;social coding&#8221; and free hosting for public projects has made GitHub the defacto place to make code available for collaboration. As a result, many free users often forget that it&#8217;s the <a href=\"https://enterprise.github.com/home\" target=\"_blank\">GitHub Enterprise</a> customers who keep the lights on at the company.</p>\n<p>Julian Dunn, a product manager at <a href=\"http://www.chef.io/\" target=\"_blank\">Chef</a>, wrote <a href=\"http://www.juliandunn.net/2016/01/14/dear-dear-github-from-your-local-friendly-product-person/\" target=\"_blank\">a response to the &#8220;Dear GitHub&#8221; letter</a>. He contends that GitHub, unless forced by heated press coverage, isn&#8217;t likely to address these concerns.</p>\n<p>&#8220;If I were the product manager for GitHub, the answer to your requests would probably be &#8216;no,\'&#8221; Dunn said. &#8220;That’s not because I think your feature requests aren’t legitimate. It’s because they don’t impact paying customers very highly. And as a company whose developers have to eat, GitHub is probably going to prioritize those customers first.&#8221;</p>\n<p>His reasoning is that the issue management problems that plague open source communities don&#8217;t affect GitHub&#8217;s bread and butter to the same degree.</p>\n<p>&#8220;Paying customers use private repositories and/or GitHub Enterprise, and the wild[er]-west aspects of an open-source ecosystem simply don’t exist inside a company,&#8221; Dunn said. &#8220;You’re unlikely to see +1-DDoS-type behavior inside private repos, for example.&#8221;</p>\n<p>GitHub has yet to officially address the &#8220;Dear GitHub&#8221; letter. With a growing list of more than 600 maintainers of popular open source projects signing the document, it will soon be in the company&#8217;s best interest to communicate a response. Authors of the letter are hoping the company will choose to act in support of its open source community to solve the unique challenges that project maintainers contend with when hosting on GitHub.</p>\n<p>If you&#8217;re an open source project maintainer, is this a letter you would sign? Does the current way that GitHub issues are structured satisfy the needs of your project and its users? Would the proposed solutions make a difference for your project?</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 15 Jan 2016 22:06:01 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:30;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"WPTavern: Happy 15th Birthday Drupal\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50632\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"http://wptavern.com/happy-15th-birthday-drupal\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4754:\"<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/05/birthday.jpg\" rel=\"attachment wp-att-23622\"><img class=\"size-full wp-image-23622\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/05/birthday.jpg?resize=1023%2C561\" alt=\"photo credit: A30_Tsitika - cc\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/frozen-in-time/2263904827/\">A30_Tsitika</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nc-nd/2.0/\">cc</a>\n<p><a href=\"https://www.drupal.org/\">Drupal</a>, the open source CMS founded by Dries Buytaert on December 29th, 2000, <a href=\"http://buytaert.net/drupal-15-years-old-and-still-gaining-momentum\">is 15 years old</a>. Drupal version 1.0.0 was released on January 15th, 2001, &#8220;The early decisions to open-source Drupal and use the <a href=\"https://en.wikipedia.org/wiki/GNU_General_Public_License\">GPL license</a> set the cornerstone principles for how our community shares with one another and builds upon each other&#8217;s achievements to this day,&#8221; Buytaert said.</p>\n<p>You might be wondering why a site devoted to WordPress is publishing a story about a competing CMS&#8217; birthday. The fact is, Drupal, Joomla and WordPress are more complimentary than they are competitors. Each is open source, licensed under the GPL, and is composed of code submitted by thousands of volunteers located across the world. All three projects make up a combined total of 37 years of experience.</p>\n<ul>\n<li>Drupal &#8211; 15 Years Old</li>\n<li>WordPress &#8211; 12 Years Old</li>\n<li>Joomla &#8211; 10 Years Old</li>\n</ul>\n<p>When Buytaert founded Drupal, many of the social networking services and browsers we enjoy today didn&#8217;t exist:</p>\n<blockquote><p>Chrome, Firefox, and Safari didn&#8217;t exist yet; most people used Netscape, Opera or Internet Explorer. New ideas for sharing and exchanging content such as &#8216;public diaries&#8217; and <a href=\"https://en.wikipedia.org/wiki/RSS\">RSS</a> had yet to gain widespread acceptance and Drupal was among the first to support those. <a href=\"https://en.wikipedia.org/wiki/History_of_Wikipedia\">Wikipedia was launched on the same day as Drupal</a> and sparked the rise of user-generated content. Facebook and Twitter didn&#8217;t exist until 4-5 years later</p></blockquote>\n<p>He describes many of the things Drupal got right like hooks and modules. There are some things the project got wrong such as adding support for OpenID which never gained widespread adoption.</p>\n<p>Near the end of his post, Buytaert reaffirms his commitment through the Drupal project to protect the privacy, serendipity and freedom of the web we enjoy, &#8220;As the web evolves from a luxury to a basic human right, it&#8217;s important that we treat it that way. To increase our impact, we have to continue to make Drupal easier to use. I&#8217;d love to help <a href=\"http://buytaert.net/winning-back-the-open-web\">build a world where people&#8217;s privacy is safe</a> and Drupal is more approachable.&#8221;</p>\n<p>At the <a href=\"https://videopress.com/v/cmA03MuQ\">State of the Word</a> at WordCamp US last year, Matt Mullenweg announced a similar role for WordPress. At the 46:58 mark, Mullenweg discusses WordPress&#8217; APIs being the key to an open web.</p>\n<p></p>\n<p>At a time when web services are <a href=\"http://thenextweb.com/twitter/2012/06/30/developers-bracing-themselves-for-twitter-api-retrictions-call-todays-post-ominous/#gref\">restricting their APIs</a> to third-party developers, WordPress which is used across 25% of the web with open APIs can help reverse the trend, &#8220;I think that we can use this opening up, especially switching to API driven development to open up more of the web. When you think about what open source looks like, when the code being available isn&#8217;t the most important thing, when we&#8217;re interacting across multiple devices, the APIs become just as important as the code itself being open,&#8221; Mullenweg said.</p>\n<p>Last but not least, check out this interview where Mullenweg and Buytaert share the same stage in 2011 at an event called <a href=\"http://www.schipulcon.com/\">Schipulcon</a>. In the interview, the duo discuss open source software and their experience managing open source projects. One of the key takeaways from the interview is Buytaert&#8217;s response when asked, how WordPress&#8217; existence benefits Drupal, &#8220;If WordPress wins, Drupal wins, because it means open source wins.&#8221;</p>\n<div class=\"embed-wrap\"></div>\n<p>Like Joomla and WordPress, Drupal is a champion of open source. Its existence and continued success should be celebrated. I hope you&#8217;ll join us by wishing the Drupal project a happy birthday!</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 15 Jan 2016 13:47:11 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:31;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"WPTavern: Easily Display Highlights of a Story With the Story Lines Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50583\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"http://wptavern.com/easily-display-highlights-of-a-story-with-the-story-lines-plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3902:\"<p>If you&#8217;re looking for an easy way to display highlights of a story inside of posts, check out a new plugin called <a href=\"https://wordpress.org/plugins/story-lines/\">Story Lines</a>, developed by <a href=\"https://profiles.wordpress.org/arenapigskin/\">Jacob Martella</a>. Story Lines adds a meta box to the Posts screen where users can name the highlights box, configure its width, how it&#8217;s displayed, and fields for three highlights with an option to add more.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/StoryLinesMetaBox.png\" rel=\"attachment wp-att-50623\"><img class=\"size-full wp-image-50623\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/StoryLinesMetaBox.png?resize=649%2C602\" alt=\"Story Lines Meta Box\" /></a>Story Lines Meta Box\n<p>To display highlights in a post, click the SL button in the visual editor which adds a shortcode to the post.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/StoryLinesShortcode.png\" rel=\"attachment wp-att-50624\"><img class=\"size-full wp-image-50624\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/StoryLinesShortcode.png?resize=642%2C348\" alt=\"Story Lines Shortcode\" /></a>Story Lines Shortcode\n<p>Here&#8217;s what Story Lines looks like on the frontend of the Tavern test site. The colors are bold and grab the reader&#8217;s attention.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/StoryLinesOutput.png\" rel=\"attachment wp-att-50625\"><img class=\"size-full wp-image-50625\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/StoryLinesOutput.png?resize=672%2C544\" alt=\"Story Lines Output\" /></a>Story Lines Output\n<p>Story Lines doesn&#8217;t have a settings panel to configure its design, &#8220;That’s one of the things I’m still learning about this whole process, is to give people complete control of how it looks. I hope to have something like that for the next version,&#8221; Martella told the Tavern.</p>\n<p>If you want to change the design of Story Lines, Martella suggests editing the <strong>story-lines</strong>, <strong>.story-lines</strong>, and <strong>.title classes</strong> with the caveat that you may have to use the <strong>!important </strong>declaration. You should save these changes to a child theme so they&#8217;re not lost when you update the plugin. The list items use the same font as the active theme.</p>\n<p>Martella has a background in journalism and is the sports editor for <a href=\"http://www.dailytexanonline.com/\">The Daily Texan</a>. While journalism is his first passion, he&#8217;s slowly transitioning to the web development world by creating themes and plugins for WordPress:</p>\n<blockquote><p>I’ve been trying to figure out a niche for myself in the WordPress development world and I’m starting to think it might be creating themes and plugins that replicate what people see on the New York Times or other top newspaper websites for others to use on their sites.</p>\n<p>My first plugin, <a href=\"https://wordpress.org/plugins/jm-breaking-news/\">JM Breaking News</a>, and the <a href=\"https://wordpress.org/themes/giornalismo\">Giornalismo</a> theme I created are also examples of that. So really, I’m just trying to explore the niche where web development and journalism collide and WordPress is the tool I’m using to do just that.</p></blockquote>\n<p>There are two features I&#8217;d like to see added in a future release. The first, is the ability to rearrange highlights with a drag-and-drop interface. The second, is a way to add a URL which links to an anchor point in the article so readers can visit specific parts of a story.</p>\n<p>I tested Story Lines on WordPress 4.5 alpha and it works as expected. It&#8217;s <a href=\"https://wordpress.org/plugins/story-lines/\">available for free</a> from the WordPress plugin directory.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 15 Jan 2016 11:50:35 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"WPTavern: New Upvato Service Offers Free Backups for Envato Market Products\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50606\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"http://wptavern.com/new-upvato-service-offers-free-backups-for-envato-market-products\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5720:\"<p>If you&#8217;ve ever purchased files from Envato, chances are that you have them backed up locally or sent to a cloud storage service like Dropbox. <a href=\"https://www.upvato.com/\" target=\"_blank\">Upvato</a> is a new alternative that specializes in <a href=\"http://market.envato.com/\" target=\"_blank\">Envato Market</a> files. The free service allows Envato customers to back up their purchased files. Upvato takes a complete backup of the screenshots, descriptions, titles, and author information. In the event that an item is removed from Envato, customers who have uploaded their files to Upvato have a complete backup.</p>\n<p>Freddy Lundekvam, owner of Norway-based <a href=\"http://www.logik.no/\" target=\"_blank\">Logik Web Studios</a>, said that he was inspired to create Upvato after losing purchased files due to the fact that Envato &#8220;<a href=\"https://help.market.envato.com/hc/en-us/articles/202500244-The-Item-Has-Been-Removed\" target=\"_blank\">does not guarantee ongoing availability of items</a> after the initial download.&#8221;</p>\n<p>&#8220;I’m a heavy user of Themeforest,&#8221; Lundekvam said. &#8220;I’m a full time programmer who doesn’t know much about design, and I’m especially a huge fan of the admin templates and own 15+ of them. In total, amongst all the marketplaces I’ve bought quite a few items. Having purchased many files, I quickly learned about Envato’s right to take down and remove any file at their or the author&#8217;s sole discretion without any warning. I personally have lost 10 files because of this policy, and I find it quite annoying to lose files.&#8221;</p>\n<p>Lundekvam used to back up his files to Dropbox but found it frustrating to sort through his library without much information and no way to look them up after they disappeared from Envato. He teamed up with a colleague who is a designer and created Upvato as a solution to this problem. In addition to storing the file you purchased, Upvato also stores the screenshots, file descriptions, comments, and includes versioning &#8211; allowing you access to any version that has been uploaded.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/upvato-backup.png\" rel=\"attachment wp-att-50616\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/upvato-backup.png?resize=908%2C615\" alt=\"upvato-backup\" class=\"aligncenter size-full wp-image-50616\" /></a></p>\n<p>Users can back up an unlimited number of files and there&#8217;s no limit on the file size. Upvato creators are also committed to keeping the service free, according to the statement on their website:</p>\n<blockquote><p>Upvato is and will always fee a completely free service. We strongly believe that this is something that should be a part of Envato from day one and don&#8217;t agree with their policies.</p></blockquote>\n<p>The service uses the Envato API to allow users to back up all of their files automatically. Files can also be uploaded manually into your Upvato account.</p>\n<h3>Envato&#8217;s Response to the New Upvato Backup Service</h3>\n<p>While Envato does not officially endorse Upvato, the company encourages users to find a backup solution. Venessa Paech, Envato PR Manager, gave WP Tavern the following statement:</p>\n<blockquote><p>Envato buyers use a variety of methods for managing their purchases. Whatever service they use, whether Dropbox or a service like Upvato, we always encourage people to back up their digital assets. </p>\n<p>Envato Market is an active marketplace with thousands of sellers and millions of items. While we offer a downloads section on every account, our focus is less on post-purchase asset management, and more on discovering and purchasing wonderful digital goods that solve creative challenges.</p></blockquote>\n<p>Essentially, after the purchase has been made, Envato doesn&#8217;t find any conflict in users choosing Upvato as a backup solution. The company is unlikely to change its policy about not guaranteeing files indefinitely, as it needs to account for all kinds of circumstances including copyright complaints and technical problems. Upvato&#8217;s free backup solution may reduce the number of Envato customers who are negatively impacted when files are removed without notice.</p>\n<h3>&#8220;Storage Space is Cheap&#8221; and Upvato Doesn&#8217;t Plan to Monetize</h3>\n<p>I asked Lundekvam how he&#8217;s funding the enormous amount of space required to store files for Envato customers. &#8220;Storage space is cheap these days &#8211; hosting 10 TB of data in an Amazon Glacier is merely $7 a month,&#8221; he said. &#8220;But I also take benefit from the automated uploads.</p>\n<p>&#8220;If you connect your Envato account and back up the item, then only one file for that item will be used for all users who have the same file (Verified purchased with Envato). Every time you try to download a backup of the file from Envato, we check if the exact same file already exists amongst the items available files. If it does, it’s not stored. Instead, you use the same file that already exist in the system,&#8221; Lundekvam said.</p>\n<p>Despite having created a service that solves a real problem for potentially thousands of customers, Lundekvam said he&#8217;s not seeking a revenue model to fund his efforts. For now, the site exists to solve a problem he encountered that also affects many other Envato customers. Monetization isn&#8217;t a priority for him at this time.</p>\n<p>&#8220;Currently that’s not the plan,&#8221; he said. &#8220;Running such a site isn’t all that expensive. For now, we just wanted to make something cool and useful that people might want and need.&#8221;</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 15 Jan 2016 06:50:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:33;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"WPTavern: Human Made Publishes Free WordPress REST API Whitepaper\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50558\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"http://wptavern.com/human-made-publishes-free-wordpress-rest-api-whitepaper\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3066:\"<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/wp-rest-api.jpg\" rel=\"attachment wp-att-43000\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/wp-rest-api.jpg?resize=1025%2C469\" alt=\"wp-rest-api\" class=\"aligncenter size-full wp-image-43000\" /></a></p>\n<p>Today Human Made released its new <a href=\"https://hmn.md/wordpress-rest-api-white-paper/\" target=\"_blank\">WordPress REST API Whitepaper</a>, an in-depth guide to how the API is changing the way developers interact with WordPress. The publication was written for a diverse audience, including developers, agencies, project managers, and publishers. It includes a technical breakdown of how the REST API works, along with an overview of the benefits and challenges for teams that take on API-driven projects.</p>\n<p>The whitepaper is called &#8220;Talking to 25% of the Web,&#8221; but the title may soon need to be updated as <a href=\"http://w3techs.com/technologies/history_overview/content_management/all\" target=\"_blank\">WordPress usage in mid-January is 25.7%</a> and is forecasted to climb past 26% in Q1. It is a collaborative publication authored by the team at Human Made, which includes several lead contributors on the WP REST API team.</p>\n<p>The <a href=\"https://hmn.md/wordpress-rest-api-white-paper/\" target=\"_blank\">overview for the whitepaper</a> summarizes the different topics you&#8217;ll find within the content:</p>\n<ul>\n<li>Introduces you to the headless CMS</li>\n<li>Introduces you to REST</li>\n<li>Provides a technical overview of the WordPress REST API</li>\n<li>Explores some of the benefits of using the REST API in your project</li>\n<li>Talks about some of the ways that the REST API will change WordPress development</li>\n<li>Discusses some of the challenges that you may encounter in your REST API project</li>\n</ul>\n<p>The 44-page guide also includes case studies of companies already using the WP REST API and a list of important resources.</p>\n<p>&#8220;<a href=\"https://hmn.md/wordpress-rest-api-white-paper/\" target=\"_blank\">Talking to 25% of the Web</a>&#8221; is an excellent free resource that should be required reading for anyone using WordPress, especially those who are building for the platform, consulting, creating SaaS products, or otherwise deriving their income from the software.</p>\n<p>Human Made employs a large contingent of WP REST API team members and subsidizes much of their work on the project. The agency is heavily investing in the future of WordPress and is leading the way in helping developers learn how to build with the REST API. If you want to further your skills in this area, Human Made is also organizing an educational event called <a href=\"http://wptavern.com/a-day-of-rest-conference-session-highlights-now-available-tickets-selling-fast\" target=\"_blank\">A Day of REST</a>, which will be held on January 28, 2016. Attendees will have the opportunity to learn from the developers who are building the API as well as those who are already using it in production.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 15 Jan 2016 00:10:37 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:34;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"WPTavern: BuddyPress REST API Feature Plugin Now in Development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50549\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://wptavern.com/buddypress-rest-api-feature-plugin-now-in-development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3792:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/02/bp-featured.png\" rel=\"attachment wp-att-16395\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/02/bp-featured.png?resize=800%2C390\" alt=\"bp-featured\" class=\"aligncenter size-full wp-image-16395\" /></a></p>\n<p>Developers interested in contributing to the creation of a BuddyPress REST API met for the first time yesterday to discuss a path forward. <a href=\"https://twitter.com/bronsonquick\" target=\"_blank\">Bronson Quick</a> is leading the project with the help of <a href=\"http://modemlooper.me/\" target=\"_blank\">Ryan Fugate</a>. Quick works for <a href=\"https://hmn.md/\" target=\"_blank\">Human Made</a> and is a WordPress core contributor. He is also the lead contributor on <a href=\"https://github.com/Chassis/Chassis\" target=\"_blank\">Chassis</a>, a lightweight WP Vagrant install that uses Puppet for provisioning.</p>\n<p>John James Jacoby set up <a href=\"https://github.com/buddypress/BP-REST\" target=\"_blank\">a GitHub repository</a> where development for the BP REST API will take place. In summarizing the meeting&#8217;s discussion regarding planning and architecture, Quick said, &#8220;Planning how we tackle this is very important rather than diving straight into the code. As we’re &#8216;standing on the shoulders of giants&#8217; we can use the lessons learned from the WP REST API project and put in time at the start to plan this properly.</p>\n<p>&#8220;It makes sense to plan out the data we would like returned from endpoints and how they relate to each other with _links. For example, if we’re displaying the data for the activities endpoint rather than showing a user_id we should link this to a user endpoint.&#8221;</p>\n<p>The team will be taking a “schema first” approach and plans to adhere to Test Driven Development &#8211; planning an endpoint, writing tests that fail then writing the code for the endpoint until the tests pass.</p>\n<p>&#8220;This is something that’s often talked about as being an ideal development methodology but it’s rarely practiced in the WordPress space,&#8221; Quick said. &#8220;Tackling a project this way should mean less bugs although I do realize this could be a blocker for new contributors.&#8221;</p>\n<p>The BP REST API team plans to tackle read-only endpoints first for the activity stream and xprofile components via the _links method Quick outlined. Ryan Fugate opened a GitHub <a href=\"https://github.com/buddypress/BP-REST/issues/1\" target=\"_blank\">issue</a> regarding the plugin&#8217;s folder structure/loader, and the plan is to design it as a feature plugin that will one day land in BuddyPress core.</p>\n<h3>What is the Purpose of a BP REST API?</h3>\n<p>During the meeting contributors discussed the primary problems that a BP REST API should solve, which Quick summarized in the <a href=\"https://bpdevel.wordpress.com/2016/01/14/bp-rest-api-dev-chat-summary-for-january-14-2016/\" target=\"_blank\">meeting notes</a>.</p>\n<p>The team agreed that the main purpose for building the API is to expose BuddyPress data in a RESTful way so that developers and site owners can use it to create plugins, mobile apps, or anything else they want.</p>\n<p>&#8220;The other main purpose for the BP REST API is that we can use the endpoints going forward to alter some things internally in BuddyPress, as in the past &#8216;the functions throughout BuddyPress are very purpose built to solve one specific theme-side problem,\'&#8221; Quick said.</p>\n<p>If you want to get involved in building a REST API for BuddyPress make sure to <a href=\"https://github.com/buddypress/BP-REST/\" target=\"_blank\">follow the project on GitHub</a> and jump into the discussion happening in the #buddypress Slack channel.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 14 Jan 2016 19:28:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:35;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"WPTavern: WPWeekly Episode 221 – Interview With Micah Mitchell of Memberium\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://wptavern.com?p=50567&preview_id=50567\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"http://wptavern.com/wpweekly-episode-221-interview-with-micah-mitchell-of-memberium\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1810:\"<p>In this episode of WordPress Weekly, <a href=\"http://marcuscouch.com/\">Marcus Couch</a> and I are joined by Micah Mitchell, who is a partner in <a href=\"https://memberium.com/\">Memberium</a>, a membership development and management plugin for WordPress that connects with <a href=\"http://www.infusionsoft.com/\">Infusionsoft</a>.</p>\n<p>During the show, we discuss what Memberium has to offer for those who want to create membership sites using WordPress. Due to time constraints, we skipped the news segment and ended the show with the plugin picks of the week.</p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href=\"https://wordpress.org/plugins/mc4wp-activity/\">MailChimp Activity</a> displays your MailChimp list activity within the WordPress dashboard.</p>\n<p><a href=\"https://wordpress.org/plugins/clean-wp-admin-menu/\">Clean WP Admin Menu</a> proves an easy to use interface to hide rarely used items in the admin menu.</p>\n<p><a href=\"https://wordpress.org/plugins/story-lines/\">Story Lines</a> adds a list of story highlights at the top of posts to let readers know key points of the article.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, January 20th 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"http://www.wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #221:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 14 Jan 2016 18:11:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:36;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"WPTavern: WordPress for Android 4.9 Adds Fingerprint Scanner, Improves Media Library\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50533\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:93:\"http://wptavern.com/wordpress-for-android-4-9-adds-fingerprint-scanner-improves-media-library\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2175:\"<p>WordPress for Android <a href=\"https://apps.wordpress.org/2016/01/13/wordpress-for-android-version-4-9/\" target=\"_blank\">version 4.9</a> hit devices today with new support for the fingerprint scanner feature available in Android 6.0 Marshmallow.</p>\n<p>The WordPress app on mobile offers publishing access to all the sites you have hooked up, which is a pretty powerful door to the world that you may not want to leave unlocked for anyone who gains access to your phone. That&#8217;s why many users have opted to set up a pin lock for the app. (You can find this under Settings >> Turn Pin lock on.) The fingerprint scanner is a faster alternative to using a pin.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/fingerprint.png\" rel=\"attachment wp-att-50535\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/fingerprint.png?resize=281%2C500\" alt=\"fingerprint\" class=\"aligncenter size-large wp-image-50535\" /></a></p>\n<p>Version 4.9 also adds several key refinements to the media library experience, including a brand new  design for the details screen to match the rest of the app&#8217;s material design. The app now supports better handling of multiple photo and video uploads.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/media-details.png\" rel=\"attachment wp-att-50537\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/media-details.png?resize=281%2C500\" alt=\"media-details\" class=\"aligncenter size-large wp-image-50537\" /></a></p>\n<p>This release fixes a few bugs, most importantly one where posts were deleted instead of sent to the trash. If you accidentally lost a post this way, hoping to recall it, the problem shouldn&#8217;t happen again.</p>\n<p>Version 5.0 RC 1 was released to beta testers today via the Google Play Store beta channel. They are currently testing new WordPress.com &#8220;Site Settings&#8221; and &#8220;My Profile&#8221; screens that will allow users to change settings like site title, tagline, and public display name (among others). Look for these features in the next major release of WordPress for Android.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 13 Jan 2016 20:09:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:37;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"WPTavern: WP Asset Clean Up Plugin Removes Unused Styles and Scripts\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50512\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"http://wptavern.com/wp-asset-clean-up-plugin-removes-unused-styles-and-scripts\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4009:\"<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/09/speed.jpg\" rel=\"attachment wp-att-30119\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/09/speed.jpg?resize=927%2C425\" alt=\"photo credit: SergioMonsalve - cc\" class=\"size-full wp-image-30119\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/seegioo/4334436675/\">SergioMonsalve</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nd/2.0/\">cc</a>\n<p>In 2010 Google patented its methods for <a href=\"http://www.google.com/patents/US8645362\" target=\"_blank\">using resource load times in ranking search results</a>. The published patent describes how Google factors in page speed when presenting results:</p>\n<blockquote><p>A search result for a resource having a short load time relative to resources having longer load times can be promoted in a presentation order, and search results for the resources having longer load times can be demoted. The demotion can, in some situations, result in a search result for a resource having a short load time being presented earlier in the order than a search result for a similarly-relevant resource having a longer load time. Thus, for two resources that, apart from load times, appear to equally satisfy a user&#8217;s informational needs, the user will often select the resource that will likely load the most quickly of the two, resulting in a better user experience.</p></blockquote>\n<p>In other words, when it comes to competing resources that might seem otherwise similar, the one that loads faster gets a higher ranking. Prioritizing site speed is not only <a href=\"https://googlewebmastercentral.blogspot.com/2010/04/using-site-speed-in-web-search-ranking.html\" target=\"_blank\">important for Google rankings</a>, it&#8217;s also critical to providing the best experience for visitors.</p>\n<p>The new <a href=\"https://wordpress.org/plugins/wp-asset-clean-up/\" target=\"_blank\">WP Asset Clean Up</a> plugin addresses an often overlooked aspect of improving loading times. The plugin allows you to selectively remove unused styles and scripts from any page or post on your site. Once activated, the plugin detects all assets loaded and displays them on the post/page editing screen. You can then select the assets that are not needed for that page.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/wp-asset-clean-up.png\" rel=\"attachment wp-att-50520\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/wp-asset-clean-up.png?resize=1025%2C902\" alt=\"wp-asset-clean-up\" class=\"aligncenter size-full wp-image-50520\" /></a></p>\n<p>I tested it and found that it works as expected. It&#8217;s especially handy for home pages and content like &#8220;about&#8221; and &#8220;contact&#8221; pages where you don&#8217;t need to load as much functionality.</p>\n<p>WP Asset Clean Up is developer <a href=\"http://www.bitrepository.com\" target=\"_blank\">Gabriel Livan</a>&#8216;s first free plugin on WordPress.org.</p>\n<p>&#8220;I&#8217;m sure you&#8217;ve used themes / plugins in the past that were loading lots of assets (.css and .js files) in the front-end in pages where you only needed half of them or even less,&#8221; Livan said. &#8220;Many people have articles about making WordPress faster, but they often overlooked this part of removing the unused files. Often these are minified by caching plugins, but using the plugin I&#8217;ve developed, the minifying will be even smaller.&#8221;</p>\n<p>As long as plugin/theme authors have properly enqueued their assets, WP Asset Clean Up will be able to detect them so that you can select them for removal. The plugin helps you decrease the number of HTTP requests loaded but can also be useful for minimizing script conflicts. You can download <a href=\"https://wordpress.org/plugins/wp-asset-clean-up/\" target=\"_blank\">WP Asset Clean Up</a> from WordPress.org and use it in combination with your favorite caching plugin to improve performance.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 13 Jan 2016 06:29:03 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:38;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"WPTavern: BuddyPress 2.5 Development Kicks Off, BP-API Dev Chat Begins This Week\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50466\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"http://wptavern.com/buddypress-2-5-development-kicks-off-bp-api-dev-chat-begins-this-week\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3693:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/02/buddypress-wallpapers1.png\" rel=\"attachment wp-att-16156\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/02/buddypress-wallpapers1.png?resize=800%2C450\" alt=\"buddypress-wallpapers\" class=\"aligncenter size-full wp-image-16156\" /></a></p>\n<p>BuddyPress contributors <a href=\"https://wordpress.slack.com/archives/buddypress/p1452110516002730\" target=\"_blank\">met last week</a> to discuss the scope of the 2.5 release, which is slated for the beginning of March. Lead developer Paul Gibbs opened the meeting with a call for tickets that contributors are working on for 2.5.</p>\n<p>Core developer Mathieu Viet will be working on <a href=\"https://buddypress.trac.wordpress.org/ticket/6482\" target=\"_blank\">comment syncing between activity and post comments for Custom Post Types</a>. His patch is currently awaiting more testing and feedback. In a separate <a href=\"https://buddypress.trac.wordpress.org/ticket/6772\" target=\"_blank\">ticket</a> Viet is also working alongside core developer @r-a-y on BuddyPress embeds for activity, user profiles, groups.</p>\n<p>BuddyPress lead developer Boone Gorges will be focusing his attention on <a href=\"https://buddypress.trac.wordpress.org/ticket/6534\" target=\"_blank\">Navigation API tweaks for single items</a> and a ticket to <a href=\"https://buddypress.trac.wordpress.org/ticket/6413\" target=\"_blank\">move xprofile field data visibility to be stored in xprofilemeta</a> (as opposed to a serialized array in usermeta).</p>\n<p>Paul Gibbs is working on <a href=\"https://buddypress.trac.wordpress.org/ticket/6592\" target=\"_blank\">overhauling BuddyPress emails with a new Email API and customization features</a>. The proposal he&#8217;s working towards uses a Post Type for email templates and a Taxonomy to store the different types of emails BuddyPress sends. This project would also introduce new HTML email templates into the BP template stack and new classes to represent an email (BP_Email), one for each type of email.</p>\n<p>Other features on the <a href=\"https://buddypress.trac.wordpress.org/roadmap\" target=\"_blank\">roadmap</a> for possible inclusion in 2.5 include <a href=\"https://buddypress.trac.wordpress.org/ticket/6210\" target=\"_blank\">a new Invitations API</a>, <a href=\"https://buddypress.trac.wordpress.org/ticket/6347\" target=\"_blank\">making xprofile fields used for signup configurable</a>, and <a href=\"https://buddypress.trac.wordpress.org/ticket/6766\" target=\"_blank\">companion stylesheets for the TwentyTwelve default theme</a>.</p>\n<h3>BP-API Development Chat Starts This Week</h3>\n<p>On Wednesday, following the regularly scheduled dev chat, contributors interested in discussing the <a href=\"https://bpdevel.wordpress.com/2016/01/11/this-wednesday-in-addition-to/\" target=\"_blank\">REST API and BuddyPress</a> will meet at <a href=\"http://www.timeanddate.com/worldclock/converted.html?iso=20160113T22&p1=3581&p2=195&p3=137&p4=152&p5=158&p6=64\" target=\"_blank\">22:00 UTC</a>. During this first chat they will decide where the BP-API will be developed and what steps are necessary to move forward. A few independent API plugins already exist but contributors hope to unify developer efforts to work on an official feature plugin.</p>\n<p>This week&#8217;s dev chat will include discussion regarding what project lead John James Jacoby has called <a href=\"http://wptavern.com/john-james-jacoby-on-navigating-buddypress-identity-crisis\" target=\"_blank\">BuddyPress&#8217; identity crisis</a>. The core team will be gathering feedback on a “Social Network” vs. “Community Software” marketing direction.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 12 Jan 2016 23:35:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:39;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"WPTavern: Watch Live: Matt Mullenweg Joins Cape Town WordPress Meetup for Fireside Chat\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50492\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:96:\"http://wptavern.com/watch-live-matt-mullenweg-joins-cape-town-wordpress-meetup-for-fireside-chat\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:713:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/07/wordpress-cape-town.jpg\" rel=\"attachment wp-att-26698\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/07/wordpress-cape-town.jpg?resize=822%2C378\" alt=\"wordpress-cape-town\" class=\"aligncenter size-full wp-image-26698\" /></a></p>\n<p>Matt Mullenweg is in Cape Town and will be joining the <a href=\"http://www.wpcapetown.co.za/\" target=\"_blank\">local WordPress community meetup</a> for a fireside chat at noon EST (7pm Cape Town). The event begins in under an hour and will be live streamed on their YouTube channel. The video will also be available after the meetup has concluded.</p>\n<p></p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 12 Jan 2016 16:26:56 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:40;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"WPTavern: How to Assign Icons, Images, and Colors to Categories and Tags in The WordPress Backend\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50478\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:105:\"http://wptavern.com/how-to-assign-icons-images-and-colors-to-categories-and-tags-in-the-wordpress-backend\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4600:\"<p>When WordPress 4.4 was <a href=\"http://wptavern.com/wordpress-4-4-clifford-featuring-responsive-images-twenty-sixteen-and-more\">released in late 2015</a>, some <a href=\"http://wptavern.com/wordpress-4-4-clifford-featuring-responsive-images-twenty-sixteen-and-more#comment-112322\">users questioned</a> how to add colors and icons to categories as illustrated at the 1:17 mark in the <a href=\"https://videopress.com/v/J44FHXvg\">release video</a>. The colors and icons are not something users can define by default. Instead, they&#8217;re exposed by plugins using the <a href=\"https://make.wordpress.org/core/2015/10/23/4-4-taxonomy-roundup/\">Taxonomy Term Meta</a> feature in 4.4.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/TaxonomyColorsandIcons.png\" rel=\"attachment wp-att-50480\"><img class=\"size-full wp-image-50480\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/TaxonomyColorsandIcons.png?resize=685%2C381\" alt=\"WordPress 4.4 Release Video Showing Colors and Icons\" /></a>WordPress 4.4 Release Video Showing Colors and Icons\n<p>To add icons, images, or colors to taxonomy terms such as categories and tags, I recommend using <a href=\"https://wordpress.org/plugins/wp-term-images/\">WP Term Images</a>, <a href=\"https://wordpress.org/plugins/wp-term-icons/\">WP Term Icons</a>, and <a href=\"https://wordpress.org/plugins/wp-term-colors/\">WP Term Colors</a>. All three plugins are developed by, <a href=\"https://profiles.wordpress.org/johnjamesjacoby/\">John James Jacoby,</a> and are part of <a href=\"http://wptavern.com/stuttter-plugins-now-available-on-wordpress-org\">his Stuttter project</a>.</p>\n<p>Note, that in order to assign icons, images, and colors to taxonomies in WordPress 4.3 or earlier using these plugins, you&#8217;ll need to install and activate the <a href=\"https://wordpress.org/plugins/wp-term-meta/\">WP Term Meta</a> plugin as it adds Term Meta support.</p>\n<p>Once all three plugins are installed and activated, browse to the Categories section of the WordPress backend. You&#8217;ll see new fields where you can assign an icon, color, and image. Icons use the <a href=\"https://developer.wordpress.org/resource/dashicons/#admin-appearance\">Dashicon set</a> that ships with WordPress.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/SelectingAnIcon.png\" rel=\"attachment wp-att-50481\"><img class=\"size-full wp-image-50481\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/SelectingAnIcon.png?resize=682%2C334\" alt=\"Icon Picker\" /></a>Icon Picker\n<p>Choosing a color is easy as WP Term Colors uses the built-in color picker provided by WordPress.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/SelectingAColor.png\" rel=\"attachment wp-att-50484\"><img class=\"size-full wp-image-50484\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/SelectingAColor.png?resize=686%2C562\" alt=\"Assigning a color to Taxonomies\" /></a>Assigning A Color to Taxonomies\n<p>WP Term Images uses the WordPress Media Library to assign an image. Here&#8217;s what a category looks like with a color, image, and icon.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/AssignedColorImageIcon.png\" rel=\"attachment wp-att-50485\"><img class=\"size-full wp-image-50485\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/AssignedColorImageIcon.png?resize=837%2C239\" alt=\"Icon, Color, and Image Assigned To The News Category\" /></a>Icon, Color, and Image Assigned To The News Category\n<p>The visual queues are only displayed on the taxonomy management page. In a future update, I&#8217;d like to see visual queues in the same areas of the WordPress backend where a taxonomy is displayed. For example, displaying the icon, color, or image for a category on the Post management screen. The category management page is something I rarely visit once a site is established. However, I visit the Post management screen on a daily basis. At the same time, I question the usefulness of displaying something next to individual tags.</p>\n<p>These plugins are examples of what&#8217;s possible with taxonomy term meta support in WordPress 4.4. I tested each plugin on WordPress 4.5 alpha and didn&#8217;t experience any problems. If you&#8217;d like to learn more about term meta and how to use it, I encourage you to <a href=\"http://themehybrid.com/weblog/introduction-to-wordpress-term-meta\">read this tutorial</a> by Justin Tadlock. What use cases or scenarios can you think of where the visual queues described above would come in handy?</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 12 Jan 2016 12:17:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:41;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"WPTavern: Easily Hide Menus in WordPress With The Clean WP Admin Menu Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50469\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"http://wptavern.com/easily-hide-menus-in-wordpress-with-the-clean-wp-admin-menu-plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2400:\"<p>The WordPress admin menu is fairly easy to navigate out-of-the-box but can become unruly over time. It can get out of control depending on the number of custom post types registered and plugins that add a top-level menu. If you want to hide rarely used menus from the admin menu, check out the <a href=\"https://wordpress.org/plugins/clean-wp-admin-menu/\">Clean WP Admin Menu</a> plugin developed by,<a href=\"https://profiles.wordpress.org/borantula/\"> Bora Yalçın</a>.</p>\n<p>After activating the plugin, browse to the <strong>Settings &gt; Clean Admin Menu</strong> area in the WordPress backend. This is where you choose which menus to hide. Checking the box next to an item will hide it from view.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/WPCleanAdminMenuSettings.png\" rel=\"attachment wp-att-50470\"><img class=\"size-full wp-image-50470\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/WPCleanAdminMenuSettings.png?resize=571%2C644\" alt=\"WP Clean Admin Menu Settings\" /></a>WP Clean Admin Menu Settings\n<p>If you need to access a hidden menu, click the <strong>Toggle Extra</strong> link. Here&#8217;s an animated GIF provided by Yalçın that shows how it works.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/CleanWPMenuInAction.gif\" rel=\"attachment wp-att-50471\"><img class=\"size-full wp-image-50471\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/CleanWPMenuInAction.gif?resize=446%2C769\" alt=\"Clean WP Menu in Action\" /></a>Clean WP Menu in Action\n<p>Accessing a menu that&#8217;s hidden becomes a two-click process instead of one, but it&#8217;s a trade-off users might make in order to achieve a cleaner interface. Menus are hidden globally and are not tied to user accounts.</p>\n<p>Yalçın may add the ability to specify whether a menu is hidden globally or per-user in a future update in addition to a &#8220;Smart Clean&#8221; option. The idea is that if a user hasn&#8217;t accessed a menu in a certain amount of time, the plugin will automatically hide it from view.</p>\n<p>I tested <a href=\"https://wordpress.org/plugins/clean-wp-admin-menu/\">Clean WP Admin Menu</a> on WordPress 4.5 alpha and it works as expected. This plugin is a proof of concept so if you have any feedback or features you&#8217;d like to see added, please provide them in the comments.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 12 Jan 2016 08:32:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:42;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:16:\"Matt: Thirty-Two\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=45743\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://ma.tt/2016/01/thirty-two/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3294:\"<p>My thirty-second birthday has arrived after a whirlwind year, probably my most challenging and rewarding. It went faster than any year I can remember, absolutely flew by. Luckily it was capped at the holidays with a precious few weeks of downtime in Houston. Now I&#8217;m back to work in Cape Town and just finished a lovely day of great food, wine, and conversation with colleagues who are here for a meetup starting tomorrow.</p>\n<p>Since I started tracking, 2015 was the first year that I traveled fewer miles than the year before, clocking in at 398k, down 27k. (398,553 miles, 111 cities, 20 countries.) In 2016 I&#8217;m going to try and get that even lower. It was also one of my best years for blogging on this site, with the most posts (252) I&#8217;ve made since 2008, and the most words (24,605) since 2005. (If anyone is curious, I wrote about 60k words over the same time period in <a href=\"http://automattic.com/\">Automattic&#8217;s</a> internal <a href=\"http://p2theme.com/\">P2s</a>.) In a weird omission, though, it&#8217;s the first year since this site started in 2002 that I didn&#8217;t post a single gallery of photos. I&#8217;ve developed a mental block around processing and posting the fancier pictures, even as I carry hundreds of gigabytes of them around the planet several times over. Hopefully this is something I can get past in 2016.</p>\n<p>I ran 163 miles in 2015, more than I did the year before, and I think that trend will continue. Last year <a href=\"https://ma.tt/2015/01/thirty-one/\">I talked about habits and small actions</a>, and a daily todo list with some small items to nourish the mind, soul, and body has become central to my routine. I dyed my hair (grey) just for fun and also to show the rest of Automattic they could too, how you look doesn&#8217;t matter one iota. My restaurant quest has continued, and I&#8217;ve now been to 38% of <a href=\"http://www.theworlds50best.com/list/1-50-winners\">the current top 50 list</a>.</p>\n<p>More so than before, I really don&#8217;t know what&#8217;s around the corner. While there is a lot in motion, there is even more still being defined and started. There&#8217;s freedom in the groove, to reference <a href=\"http://joshuaredman.com/\">Joshua Redman&#8217;s</a> great album, and I&#8217;m getting a lot more comfortable with ambiguity and the faster pace of life in general. More than ever, I consider myself incredibly lucky, so it&#8217;s exciting to make the most of the opportunity that the volatility, love, loss, glory, failure, inspirations, and setbacks that 2016 will bring.</p>\n<p>Previously: <a href=\"https://ma.tt/2003/01/bday/\">19</a>, <a href=\"https://ma.tt/2004/01/so-im-20/\">20</a>, <a href=\"https://ma.tt/2005/01/hot-barely-legal-matt/\">21</a>, <a href=\"https://ma.tt/2006/01/matt-22/\">22</a>, <a href=\"https://ma.tt/2007/01/twenty-three/\">23</a>, <a href=\"https://ma.tt/2008/01/twenty-four/\">24</a>, <a href=\"https://ma.tt/2009/01/twenty-five/\">25</a>, <a href=\"https://ma.tt/2010/01/twenty-six/\">26</a>, <a href=\"https://ma.tt/2011/01/twenty-seven/\">27</a>, <a href=\"https://ma.tt/2012/01/twenty-eight/\">28</a>, <a href=\"https://ma.tt/2013/01/twenty-nine/\">29</a>, <a href=\"https://ma.tt/2014/01/matt-3-0/\">30</a>, and <a href=\"https://ma.tt/2015/01/thirty-one/\">31</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 11 Jan 2016 23:58:27 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:43;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"WPTavern: Stuttter Plugins Now Available on WordPress.org\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50441\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"http://wptavern.com/stuttter-plugins-now-available-on-wordpress-org\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4714:\"<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/stuttter.png\" rel=\"attachment wp-att-50449\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/stuttter.png?resize=1025%2C452\" alt=\"stuttter\" class=\"aligncenter size-full wp-image-50449\" /></a></p>\n<p>The whole collection of plugins from John James Jacoby&#8217;s <a href=\"http://jaco.by/2015/10/16/meet-stuttter/\" target=\"_blank\">Stuttter project</a> is now <a href=\"https://profiles.wordpress.org/stuttter/#content-plugins\" target=\"_blank\">available on WordPress.org</a>. Jacoby created Stuttter as &#8220;a conduit for rethinking WordPress from the outside in,&#8221; and started pushing the plugins to the official plugin directory a couple months ago.</p>\n<p>During the first half of 2015, he worked full-time on WordPress&#8217; sister projects (BuddyPress, bbPress, and GlotPress), thanks to the <a href=\"http://wptavern.com/buddypress-bbpress-and-glotpress-development-campaign-is-now-fully-funded\" target=\"_blank\">successful funding</a> of his independent IndieGoGo campaign. After completing this project, Jacoby returned to consulting via Flox where he had the chance to test and use the Stuttter plugins in production.</p>\n<p>&#8220;It’s a way to independently test the waters for what we can do with it [WordPress], without deviating from its history, beauty, charm, and chutzpah,&#8221; Jacoby said.</p>\n<p>&#8220;I was recently inspired by Jeremy Felt’s <a href=\"https://jeremyfelt.com/2015/10/02/what-wordpress-plugins-are-excellent/\" target=\"_blank\">post about what he looks for in plugins</a> that he would want to use. We’ve chatted about it before, and he finally put it into words. Stuttter sticks to those philosophies (no nags, no licenses, nothing to cut out, etc…),&#8221; he said.</p>\n<p>The new <a href=\"https://profiles.wordpress.org/stuttter/#content-plugins\" target=\"_blank\">Stuttter profile on WordPress.org</a> is home to 18 lean plugins, each carefully chiseled to do one thing well.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/stuttter-plugins.png\" rel=\"attachment wp-att-50458\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/stuttter-plugins.png?resize=1025%2C1001\" alt=\"stuttter-plugins\" class=\"aligncenter size-full wp-image-50458\" /></a></p>\n<p>&#8220;My end goal is to point most public facing links for each plugin to a product on <a href=\"https://store.flox.io/\" target=\"_blank\">store.flox.io</a> (using Easy Digital Downloads) and sell them for a few pennies, and then use WordPress.org for updates and distribution,&#8221; Jacoby said. &#8220;That way people get a zip of a plugin they purchased and get to &#8216;own&#8217; their copy, plus I have a record of their purchase on <a href=\"https://flox.io/\" target=\"_blank\">flox.io</a> so they can use that plugin on their hosted networks eventually too.</p>\n<p>Jacoby plans to make the Stuttter plugins available on Flox for the communities hosted there.</p>\n<p>&#8220;Many of them will be on by default, like WP Chosen and WP Pretty Filters,&#8221; he said. &#8220;Others will be &#8216;unlocked&#8217; through purchases, like User Activity and User Parents.</p>\n<p>&#8220;The goal is to strike a balance between a good default experience, and letting people upgrade through purchases, and then being able to take those purchases with them if they decide to self-host eventually (vs. losing them like on wpcom),&#8221; Jacoby said.</p>\n<p>Developers who are interested in the code can find the Stuttter plugins <a href=\"https://code.flox.io/groups/stuttter/\" target=\"_blank\">publicly mirrored on Flox</a>. They are actively developed there and then pushed out to <a href=\"https://github.com/stuttter\" target=\"_blank\">GitHub</a> in bulk.</p>\n<p>&#8220;Almost all of these are ideas I’ve been imagining in one way or another for years, particularly WP User Profiles,&#8221; Jacoby said. &#8220;I’ve wanted that for BuddyPress forever, but it’s always been too big of a gamble to commit to something this drastic for a project like BuddyPress that is so well established.</p>\n<p>&#8220;I think whenever you have a long time to imagine what life would be like once something is possible, you can execute very quickly once it is. Most of the current generation Stuttter plugins came rapid-fire because of several years of thought about them first. I hadn’t even done much research into alternatives (the Stream plugin vs. WP User Activity for example, and WooCommerce has its own Term Meta tweaks too). I just knew I wanted to solve a certain problem in a certain way, and had the time and motivation to make it happen,&#8221; he said.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 11 Jan 2016 22:09:49 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:44;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"Matt: Interview in El Pais\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=45737\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"https://ma.tt/2016/01/interview-in-el-pais/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:314:\"<p><span class=\"embed-youtube\"></span></p>\n<p>If you speak Spanish, or know someone who does, check out this video and <a href=\"http://one.elpais.com/gracias-a-el-se-publica-la-cuarta-parte-de-las-webs-del-mundo-matt-mullenweg-fundador-de-wordpress/\">article that was on the El Pais homepage earlier today</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 08 Jan 2016 22:48:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:45;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"WPTavern: WordCamp Europe 2016 Sold Out, Organizers Working to Get More Venue Space\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50345\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"http://wptavern.com/wordcamp-europe-2016-sold-out-organizers-working-to-get-more-venue-space\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2701:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/12/wceu-2016.png\" rel=\"attachment wp-att-49423\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/12/wceu-2016.png?resize=1025%2C407\" alt=\"wceu-2016\" class=\"aligncenter size-full wp-image-49423\" /></a></p>\n<p>If you waited to buy your ticket to <a href=\"https://2016.europe.wordcamp.org/\" target=\"_blank\">WordCamp Europe 2016</a> in Vienna, you may be out of luck. The event sold out on December 31, 2015. All 1550 tickets, including 50 micro-sponsorship tickets are now gone.</p>\n<p>&#8220;We&#8217;re currently at full capacity of our venue, but working towards expanding by hiring more halls in the MuzeumQuartier so we can meet the strong demand,&#8221; organizer Petya Raykovska told the Tavern.</p>\n<p>&#8220;We will try and release 200 more tickets in the days to follow, depending on the availability of the halls around the MQ,&#8221; she said. A <a href=\"https://2016.europe.wordcamp.org/wordcamp-europe-is-sold-out-sign-up-for-the-tickets-waiting-list/\" target=\"_blank\">waiting list</a> is now open for those hopeful to grab a ticket when more venue space opens up. According to Raykovska, the list already has nearly 100 signups.</p>\n<p>Based on the attendees confirmed so far, WordCamp Europe 2016 will have 58 countries represented, which is six more than the event had in 2014 and 2015. Including micro-sponsor tickets, the countries with the highest number of attendees include Germany (8%), Netherlands (8%), UK (8%), Austria (7%), and the United States (6%).</p>\n<p>Planning early has paid off for the organizing team with another year of successful ticket sales in the bag. Raykovska attributes this to the location and the quality of past WCEU events.</p>\n<p>&#8220;Obviously, Vienna being central for Europe and a fabulous location, has helped us attract more people this year,&#8221; Raykovska said. &#8220;But I believe above all, the huge interest is a testament about the quality we&#8217;ve been able to provide in previous years, establishing WordCamp Europe as a can&#8217;t-miss event for anyone running or involved with a WordPress business.</p>\n<p>&#8220;I also think people appreciate that we released tickets so early. More than 80% of WordCamp Europe attendees come from outside the host country so being able to plan early helped people make a decision,&#8221; she said.</p>\n<p>The <a href=\"https://2016.europe.wordcamp.org/the-call-for-speakers-for-wceu-2016-closes-in-4-weeks/\" target=\"_blank\">call for speakers</a> will close on January 31st. Speakers will be notified by March 16th as to whether or not their session will be on the schedule.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 08 Jan 2016 21:54:16 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:46;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"WPTavern: WordCamp US Is Accepting Applications for 2017-18 Host City\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50402\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"http://wptavern.com/wordcamp-us-is-accepting-applications-for-2017-18-host-city\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1735:\"<p>The application process to be the host city for WordCamp US 2017 and 2018 <a href=\"https://2016.us.wordcamp.org/2016/01/08/applications-for-the-wordcamp-us-2017-host-city-now-open/\">is now open</a>. A lot of work goes into making WordCamp US successful and planning needs to start as soon as possible. The goal is to have future host city organizers be involved in the second year&#8217;s planning to learn the process and pass on the lessons learned to the next group of organizers.</p>\n<p>If you&#8217;re thinking about applying to be the host city, you&#8217;ll need to know the following information.</p>\n<ul>\n<li>The names and contact information for your organizing team.</li>\n<li>Information about your location, including:\n<ul>\n<li>Do the venues have hotels within 3 miles that can support 1,500-2,000 attendees? Average hotel costs for budget, mid-range, and high-end hotels.</li>\n<li>Flight costs from the West Coast, East Coast, Midwest, Mexico, and Canada.</li>\n</ul>\n</li>\n<li>Venue information with an option to suggest a second venue. Each venue requires:\n<ul>\n<li>A budget</li>\n<li>Room capacities</li>\n<li>Dates available</li>\n<li>Additional venue details</li>\n</ul>\n</li>\n<li>Contributor day information, including:\n<ul>\n<li>Venue</li>\n<li>Wifi information</li>\n</ul>\n</li>\n</ul>\n<p>The new location will be selected before WordCamp US 2016. When the six cities were chosen to possibly host WordCamp US 2015, <a href=\"http://wptavern.com/which-one-of-these-six-cities-should-host-wordcamp-us\">Tavern readers voted</a> for Phoenix, AZ over Philadelphia, PA. If you have any questions or need help filling out the application, contact <strong>support @ wordcamp.org</strong>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 08 Jan 2016 19:37:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:47;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"WPTavern: How WordCamp Paris Streamlined Speaker Submissions with the Idea Stream Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50381\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:98:\"http://wptavern.com/how-wordcamp-paris-streamlined-speaker-submissions-with-the-idea-stream-plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:11361:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/jenny-beaumont.jpg\" rel=\"attachment wp-att-50383\"><img class=\"alignright size-thumbnail wp-image-50383\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/jenny-beaumont.jpg?resize=150%2C150\" alt=\"jenny-beaumont\" /></a>This post was contributed by guest author <a href=\"http://www.jennybeaumont.com/\" target=\"_blank\">Jenny Beaumont</a>. Jenny Beaumont is co-organizer of WordCamp Paris &amp; WordCamp Europe, a frequent speaker at WordCamps in France and abroad, and a contributor to a number of blogs. After 17 years building things in and around the web, she is taking a year-long sabbatical to get a new outlook on life.</p>\n<hr />\n<p>If you’ve organized a WordCamp or similar event, then you know the work involved in managing a call for papers. With every submission comes lots of information, both about the candidate and the proposed talk. And with some candidates submitting multiple proposals, the total number of submissions can be 3-4 times the number of slots available.</p>\n<p>The call for speakers for <a href=\"https://paris.wordcamp.org/2016/\" target=\"_blank\">WordCamp Paris 2016</a> brought in upwards of 70 candidates and over 100 proposals!</p>\n<p>In the past, most WordCamps have taken proposals through online forms and then organized them within spreadsheets for deliberation. But just as WordCamp Paris has grown in recent years, so has the organizing team, and the spreadsheet method became increasingly laborious and inefficient.</p>\n<h3>There’s a plugin for that</h3>\n<p>While preparing for <a href=\"https://paris.wordcamp.org/2015/\" target=\"_blank\">WordCamp Paris 2015</a>, the organizers decided to tackle this problem, and turned to <a href=\"https://wordpress.org/plugins/wp-idea-stream/\" target=\"_blank\">WP Idea Stream</a>, a plugin developed by <a href=\"https://profiles.wordpress.org/imath\" target=\"_blank\">Mathieu Viet</a> (who has since joined the organizing team).</p>\n<p>As the name suggests, WP Idea Stream is a collaborative tool built for the purpose of sharing and managing ideas between members of a WordPress site. A close look shows us that this simple concept contains a lot of intricate and useful features.</p>\n<h3>Advantages for users</h3>\n<p>Filling out a form one time is no trouble, but what if you want to submit multiple proposals? Or, what if you’re interrupted while filling out a form and have to start over?</p>\n<p>WP Idea Stream solves this problem by giving talk candidates a simple one-time sign-up. With their own account they can:</p>\n<ul>\n<li>Update their personal information at any time (name, biography, social media accounts, email address, phone number, etc)</li>\n<li>Submit multiple proposals without needing to resubmit personal information</li>\n<li>Edit each proposal for up to one hour after submission</li>\n<li>Access and consult their submissions at any time</li>\n</ul>\n<h3>Advantages for organizers</h3>\n<p>Some team members wait until closing to sit and evaluate the proposals in one go, while others prefer to react over time as talks roll in. How do you keep track of those you’ve seen? How do you exchange thoughts and opinions with your teammates? How do you navigate through all of this information?</p>\n<h3>Vote</h3>\n<p>WP Idea Stream uses a five-star rating system to vote on ideas (or talks in our case). This makes it easy to see which are the most popular among a large group of organizers.</p>\n<p>The plugin settings page includes an easy way to customize the wording for each level.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/hover-captions.png\" rel=\"attachment wp-att-50387\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/01/hover-captions.png?resize=1025%2C133\" alt=\"hover-captions\" class=\"aligncenter size-full wp-image-50387\" /></a></p>\n<h3>Comment and debate</h3>\n<p>To compliment this voting system, organizers can leave comments on each submission to further bolster their argument for or against a talk. They also have the opportunity to point out information that might be lacking, ask questions of the candidate, or make notes of recurring themes that emerge.</p>\n<h3>Track and filter</h3>\n<p>As an administrator, there are two ways to view talk proposals: the main “post” view, and a view from within your own profile.</p>\n<p><strong>The “post” view</strong> is much like the default blog home page on a standard WordPress site. Submissions are listed in chronological descending order by default, including pagination and a display of the total number of talks to date. Then, there is the possibility to:</p>\n<ul>\n<li>Search by keyword</li>\n<li>Filter by votes (highest ratings first)</li>\n<li>Filter by most commented</li>\n</ul>\n<p>The excerpt for each talk submission includes:</p>\n<ul>\n<li>The avatar of the candidate (candidates are encouraged to use the email address associated with their Gravatar account at sign up)</li>\n<li>The name of the talk</li>\n<li>The number of comments with a quick link to that section of the talk</li>\n<li>The current average rating, with a quick link to vote on that talk</li>\n<li>An excerpt of the talk description</li>\n<li>A list of all category and tag selections</li>\n<li>The date of submission</li>\n<li>A quick link to edit the proposal in the WordPress admin</li>\n</ul>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/excerpts.png\" rel=\"attachment wp-att-50389\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/excerpts.png?resize=1025%2C778\" alt=\"excerpts\" class=\"aligncenter size-full wp-image-50389\" /></a></p>\n<p><strong>The “profile” view</strong> is intended for subscribed users to view their own submissions and to manage their personal information. As an admin, this front-end view also includes some very useful tabs to help keep track of your participation in the deliberation process.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/profile-view.png\" rel=\"attachment wp-att-50390\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/profile-view.png?resize=1025%2C737\" alt=\"profile-view\" class=\"aligncenter size-full wp-image-50390\" /></a></p>\n<ul>\n<li><strong>Published.</strong> Shows any and all submissions you might have made. Yes, WordCamp Paris organizers are also often speakers!</li>\n<li><strong>Commented.</strong> Shows all talk proposals that you’ve already commented on.</li>\n<li><strong>Evaluated.</strong> Shows all talk proposals that you’ve already voted on.</li>\n<li><strong>To be evaluated.</strong> Shows all talk proposals that are still awaiting your vote.</li>\n</ul>\n<h3>Organize</h3>\n<p>By default, WP Idea Stream comes with standard WordPress category and tag taxonomies, allowing submissions to be further classified and qualified. This year for WordCamp Paris, we used categories to represent three talk formats: 10, 20 and 30-minute preferences.</p>\n<p>We use tags for what we call talk “zooms” (basically just thematic tags). The advantage here is that, just like standard WordPress tags, users can be prompted with “most used” keywords to describe their talk’s theme.</p>\n<p>Categories and tags have quick links to filter the view by those terms.</p>\n<p>This has proven extremely useful for spotting recurring subjects and trends, comparing similar proposals, and even for figuring out subjects that haven’t been covered that we might want to find speakers for.</p>\n<h3>Export</h3>\n<p>When it comes down to it, you can’t get around the good old-fashioned spreadsheet for finalizing the job.</p>\n<p>Once the team has finished rating all of the talks, the submissions can be easily exported to a spreadsheet, and sorted by vote, theme, and talk duration. From here, the program is built up and finalized, and the bulk of the work is already done.</p>\n<h3>Requirements</h3>\n<p>Using WP Idea Stream does requires us to have and maintain a WordPress installation separate from our official WordCamp site, but this is also proving to have a number of advantages including:</p>\n<ul>\n<li>A dedicated domain for emails</li>\n<li>A permanent site that can act as a long-term archive, essentially regrouping information and links to each year’s dedicated site</li>\n</ul>\n<h3>Customization</h3>\n<p>WP Idea Stream doesn’t work like this out-of-the-box. Many of these features were built specifically for our purposes. Because the plugin is developed to be highly extensible, adapting it for your own needs is relatively easy.</p>\n<h3>Templates</h3>\n<p>WP Idea Stream is built with a templating system, allowing you to easily override any of the front-end views from your own theme.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/templates.png\" rel=\"attachment wp-att-50392\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/01/templates.png?resize=398%2C506\" alt=\"templates\" class=\"aligncenter size-full wp-image-50392\" /></a></p>\n<h3>Custom functions</h3>\n<p>Placing a file named <a href=\"https://github.com/imath/wc-talk#wordcamp-talk\" target=\"_blank\">wp-idea-stream-custom.php</a> in wp-content/plugins/ extends the plugin, allowing you to build on the default functionality.</p>\n<p>Here are some of the features we’ve added to adapt the plugin to our needs:</p>\n<ul>\n<li>Publish the content (talks) in private mode</li>\n<li>Extended user fields, including language preference (the site then displays by default in the preferred language)</li>\n<li>Time limit for editing talk submissions</li>\n<li>Front-end admin tabs for viewing submissions by those rated and those still needing to be rated</li>\n<li>Back-end modifications so that the plugin name and icon are changed in the admin menu.</li>\n<li>Added a metabox with additional checkboxes to further classify talks by targeted audience</li>\n<li>Added user role of “speaker,” essentially with the same permissions as the standard “subscriber”.</li>\n</ul>\n<p>We also added a fun little function in case any candidates try to sneak a peek by hacking the site’s comment RSS feed:</p>\n<pre class=\"brush: php; light: true; title: ; notranslate\">\n/**\n * Redirect the speaker trying to cheat by adding the feed argument to the talk url :)\n */\nfunction wc_talk_neutralize_feeds_step_two() {\n	if ( is_feed() &amp;&amp; wp_idea_stream_is_ideastream() ) {\n		wp_idea_stream_add_message( array(\n			\'type\'    =&gt; \'info\',\n			\'content\' =&gt; __( \'Ah! caught trying to spy!\', \'wc-talk\' ),\n		) );\n		wp_safe_redirect( wp_idea_stream_get_redirect_url() );\n		exit();\n	}\n}\n</pre>\n<p>We have used this system for two consecutive years now, improving the functionality as we learn what features are needed to make the process as smooth and efficient as possible. Overall, we might actually spend more time on the process, but it’s qualitative time. These tools humanize the process, allowing us to easily navigate the information and further invest ourselves in both the candidates and their ideas.</p>\n<p>As a collaborative tool, it adds an element of fun that you can’t get out of a spreadsheet! This brings an added dynamic to the group, allowing us all to participate in the process and have a voice (except for those organizers who propose talks, of course! ;) ).</p>\n<p>Like the idea? You should give it a try!</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 08 Jan 2016 17:50:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:48;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"WPTavern: Progress Report: Measure Jetpack Benchmark Project\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=50395\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"http://wptavern.com/progress-report-measure-jetpack-benchmark-project\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1062:\"<p>Late in 2015, <a href=\"https://profiles.wordpress.org/ideag/#content-plugins\">Arūnas Liuiza</a>, a WordPress plugin developer, <a href=\"http://wptavern.com/measure-jetpack-an-independent-project-aimed-at-measuring-jetpacks-performance\">announced a new project</a> called <a href=\"http://blog.arunas.co/project-measure-jetpack/\">Measure Jetpack</a>. Measure Jetpack is an independent, comprehensive series of benchmarks that will show how much impact Jetpack has on a site&#8217;s performance.</p>\n<p>Over the last few months, little information has been shared on the project&#8217;s status. I reached out to Liuiza for an update, &#8220;We&#8217;ve built a decent set of sample data for testing and hope to begin actual testing next week. The plan is to have all the data by the end of the month and publish some of the results in February,&#8221; Liuiza told the Tavern.</p>\n<p>While the results are not likely to be conclusive, the benchmarks will be an important resource in an area where similar data is scarce.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 08 Jan 2016 17:04:49 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:49;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:104:\"Post Status: Challenges managing a WordPress consulting business and doing client work — Draft podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=15517\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:111:\"https://poststatus.com/challenges-managing-a-wordpress-consulting-business-and-doing-client-work-draft-podcast/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1493:\"<p>Welcome to the Post Status <a href=\"https://poststatus.com/category/draft\">Draft podcast</a>, which you can find <a href=\"https://itunes.apple.com/us/podcast/post-status-draft-wordpress/id976403008\">on iTunes</a>, <a href=\"http://www.stitcher.com/podcast/krogsgard/post-status-draft-wordpress-podcast\">Stitcher</a>, and <a href=\"http://simplecast.fm/podcasts/1061/rss\">via RSS</a> for your favorite podcatcher. Post Status Draft is hosted by Joe Hoyle &#8212; the CTO of Human Made &#8212; and Brian Krogsgard.</p>\n<p>This week’s Post Status Draft podcast is hosted by Brian Krogsgard and Joe Hoyle. This week, they talk working in an agency and doing client work.</p>\n<!--[if lt IE 9]><script>document.createElement(\'audio\');</script><![endif]-->\n<a href=\"https://audio.simplecast.fm/24151.mp3\">https://audio.simplecast.fm/24151.mp3</a>\n<p><a href=\"http://audio.simplecast.fm/24151.mp3\">Direct Download</a></p>\n<p>Joe and Brian discussed a variety of facets to agency and client work, including:</p>\n<ul>\n<li>Hourly billing, daily billing, and project billing</li>\n<li>Tracking time for internal or external purposes</li>\n<li>Pricing websites</li>\n<li>Taking on large versus small projects in both large and small agencies, and how risk changes in each scenario</li>\n<li>Making payroll and managing cashflow</li>\n<li>Being selective with clients</li>\n<li>Retainers and monthly maintenance plans, and how it can fit in</li>\n<li>Team structures for projects</li>\n<li>And more!</li>\n</ul>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 08 Jan 2016 15:15:15 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Katie Richards\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";a:10:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Fri, 29 Jan 2016 13:06:07 GMT\";s:12:\"content-type\";s:8:\"text/xml\";s:14:\"content-length\";s:6:\"224629\";s:10:\"connection\";s:5:\"close\";s:4:\"vary\";s:15:\"Accept-Encoding\";s:13:\"last-modified\";s:29:\"Fri, 29 Jan 2016 12:45:12 GMT\";s:15:\"x-frame-options\";s:10:\"SAMEORIGIN\";s:4:\"x-nc\";s:11:\"HIT lax 249\";s:13:\"accept-ranges\";s:5:\"bytes\";}s:5:\"build\";s:14:\"20130911030210\";}','no'),(155,'_transient_timeout_feed_mod_d117b5738fbd35bd8c0391cda1f2b5d9','1454115968','no'),(156,'_transient_feed_mod_d117b5738fbd35bd8c0391cda1f2b5d9','1454072768','no'),(157,'_transient_timeout_feed_b9388c83948825c1edaef0d856b7b109','1454115970','no'),(158,'_transient_feed_b9388c83948825c1edaef0d856b7b109','a:4:{s:5:\"child\";a:1:{s:0:\"\";a:1:{s:3:\"rss\";a:1:{i:0;a:6:{s:4:\"data\";s:3:\"\n	\n\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:7:\"version\";s:3:\"2.0\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:1:{s:7:\"cha